hebsuperobject.biblemap.put("b5_3_2", new hebsuperobject(5,3,2,"ויאמר יהוה אלי אל תירא אתו כי בידך נתתי אתו ואת כל עמו ואת ארצו ועשית לו כאשר עשית לסיחן מלך האמרי אשר יושב בחשבון׃"));
hebsuperobject.biblemap.put("b5_3_3", new hebsuperobject(5,3,3,"ויתן יהוה אלהינו בידנו גם את עוג מלך הבשן ואת כל עמו ונכהו עד בלתי השאיר לו שריד׃"));
hebsuperobject.biblemap.put("b5_3_4", new hebsuperobject(5,3,4,"ונלכד את כל עריו בעת ההוא לא היתה קריה אשר לא לקחנו מאתם ששים עיר כל חבל ארגב ממלכת עוג בבשן׃"));
hebsuperobject.biblemap.put("b5_3_5", new hebsuperobject(5,3,5,"כל אלה ערים בצרות חומה גבהה דלתים ובריח לבד מערי הפרזי הרבה מאד׃"));
hebsuperobject.biblemap.put("b5_3_6", new hebsuperobject(5,3,6,"ונחרם אותם כאשר עשינו לסיחן מלך חשבון החרם כל עיר מתם הנשים והטף׃"));
hebsuperobject.biblemap.put("b5_3_7", new hebsuperobject(5,3,7,"וכל הבהמה ושלל הערים בזונו לנו׃"));
hebsuperobject.biblemap.put("b5_3_8", new hebsuperobject(5,3,8,"ונקח בעת ההוא את הארץ מיד שני מלכי האמרי אשר בעבר הירדן מנחל ארנן עד הר חרמון׃"));
hebsuperobject.biblemap.put("b5_3_9", new hebsuperobject(5,3,9,"צידנים יקראו לחרמון שרין והאמרי יקראו לו שניר׃"));
hebsuperobject.biblemap.put("b5_3_10", new hebsuperobject(5,3,10,"כל ערי המישר וכל הגלעד וכל הבשן עד סלכה ואדרעי ערי ממלכת עוג בבשן׃"));
hebsuperobject.biblemap.put("b5_3_11", new hebsuperobject(5,3,11,"כי רק עוג מלך הבשן נשאר מיתר הרפאים הנה ערשו ערש ברזל הלה הוא ברבת בני עמון תשע אמות ארכה וארבע אמות רחבה באמת איש׃"));
hebsuperobject.biblemap.put("b5_3_12", new hebsuperobject(5,3,12,"ואת הארץ הזאת ירשנו בעת ההוא מערער אשר על נחל ארנן וחצי הר הגלעד ועריו נתתי לראובני ולגדי׃"));
hebsuperobject.biblemap.put("b5_3_13", new hebsuperobject(5,3,13,"ויתר הגלעד וכל הבשן ממלכת עוג נתתי לחצי שבט המנשה כל חבל הארגב לכל הבשן ההוא יקרא ארץ רפאים׃"));
hebsuperobject.biblemap.put("b5_3_14", new hebsuperobject(5,3,14,"יאיר בן מנשה לקח את כל חבל ארגב עד גבול הגשורי והמעכתי ויקרא אתם על שמו את הבשן חות יאיר עד היום הזה׃"));
hebsuperobject.biblemap.put("b5_3_15", new hebsuperobject(5,3,15,"ולמכיר נתתי את הגלעד׃"));
hebsuperobject.biblemap.put("b5_3_16", new hebsuperobject(5,3,16,"ולראובני ולגדי נתתי מן הגלעד ועד נחל ארנן תוך הנחל וגבל ועד יבק הנחל גבול בני עמון׃"));
hebsuperobject.biblemap.put("b5_3_17", new hebsuperobject(5,3,17,"והערבה והירדן וגבל מכנרת ועד ים הערבה ים המלח תחת אשדת הפסגה מזרחה׃"));
hebsuperobject.biblemap.put("b5_3_18", new hebsuperobject(5,3,18,"ואצו אתכם בעת ההוא לאמר יהוה אלהיכם נתן לכם את הארץ הזאת לרשתה חלוצים תעברו לפני אחיכם בני ישראל כל בני חיל׃"));
hebsuperobject.biblemap.put("b5_3_19", new hebsuperobject(5,3,19,"רק נשיכם וטפכם ומקנכם ידעתי כי מקנה רב לכם ישבו בעריכם אשר נתתי לכם׃"));
hebsuperobject.biblemap.put("b5_3_20", new hebsuperobject(5,3,20,"עד אשר יניח יהוה לאחיכם ככם וירשו גם הם את הארץ אשר יהוה אלהיכם נתן להם בעבר הירדן ושבתם איש לירשתו אשר נתתי לכם׃"));
hebsuperobject.biblemap.put("b5_3_21", new hebsuperobject(5,3,21,"ואת יהושוע צויתי בעת ההוא לאמר עיניך הראת את כל אשר עשה יהוה אלהיכם לשני המלכים האלה כן יעשה יהוה לכל הממלכות אשר אתה עבר שמה׃"));
hebsuperobject.biblemap.put("b5_3_22", new hebsuperobject(5,3,22,"לא תיראום כי יהוה אלהיכם הוא הנלחם לכם׃"));
hebsuperobject.biblemap.put("b5_3_23", new hebsuperobject(5,3,23,"ואתחנן אל יהוה בעת ההוא לאמר׃"));
hebsuperobject.biblemap.put("b5_3_24", new hebsuperobject(5,3,24,"אדני יהוה אתה החלות להראות את עבדך את גדלך ואת ידך החזקה אשר מי אל בשמים ובארץ אשר יעשה כמעשיך וכגבורתך׃"));
hebsuperobject.biblemap.put("b5_3_25", new hebsuperobject(5,3,25,"אעברה נא ואראה את הארץ הטובה אשר בעבר הירדן ההר הטוב הזה והלבנון׃"));
hebsuperobject.biblemap.put("b5_3_26", new hebsuperobject(5,3,26,"ויתעבר יהוה בי למענכם ולא שמע אלי ויאמר יהוה אלי רב לך אל תוסף דבר אלי עוד בדבר הזה׃"));
hebsuperobject.biblemap.put("b5_3_27", new hebsuperobject(5,3,27,"עלה ראש הפסגה ושא עיניך ימה וצפנה ותימנה ומזרחה וראה בעיניך כי לא תעבר את הירדן הזה׃"));
hebsuperobject.biblemap.put("b5_3_28", new hebsuperobject(5,3,28,"וצו את יהושע וחזקהו ואמצהו כי הוא יעבר לפני העם הזה והוא ינחיל אותם את הארץ אשר תראה׃"));
hebsuperobject.biblemap.put("b5_3_29", new hebsuperobject(5,3,29,"ונשב בגיא מול בית פעור׃"));
hebsuperobject.biblemap.put("b5_4_1", new hebsuperobject(5,4,1,"ועתה ישראל שמע אל החקים ואל המשפטים אשר אנכי מלמד אתכם לעשות למען תחיו ובאתם וירשתם את הארץ אשר יהוה אלהי אבתיכם נתן לכם׃"));
hebsuperobject.biblemap.put("b5_4_2", new hebsuperobject(5,4,2,"לא תספו על הדבר אשר אנכי מצוה אתכם ולא תגרעו ממנו לשמר את מצות יהוה אלהיכם אשר אנכי מצוה אתכם׃"));
hebsuperobject.biblemap.put("b5_4_3", new hebsuperobject(5,4,3,"עיניכם הראת את אשר עשה יהוה בבעל פעור כי כל האיש אשר הלך אחרי בעל פעור השמידו יהוה אלהיך מקרבך׃"));
hebsuperobject.biblemap.put("b5_4_4", new hebsuperobject(5,4,4,"ואתם הדבקים ביהוה אלהיכם חיים כלכם היום׃"));
hebsuperobject.biblemap.put("b5_4_5", new hebsuperobject(5,4,5,"ראה למדתי אתכם חקים ומשפטים כאשר צוני יהוה אלהי לעשות כן בקרב הארץ אשר אתם באים שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_4_6", new hebsuperobject(5,4,6,"ושמרתם ועשיתם כי הוא חכמתכם ובינתכם לעיני העמים אשר ישמעון את כל החקים האלה ואמרו רק עם חכם ונבון הגוי הגדול הזה׃"));
hebsuperobject.biblemap.put("b5_4_7", new hebsuperobject(5,4,7,"כי מי גוי גדול אשר לו אלהים קרבים אליו כיהוה אלהינו בכל קראנו אליו׃"));
hebsuperobject.biblemap.put("b5_4_8", new hebsuperobject(5,4,8,"ומי גוי גדול אשר לו חקים ומשפטים צדיקם ככל התורה הזאת אשר אנכי נתן לפניכם היום׃"));
hebsuperobject.biblemap.put("b5_4_9", new hebsuperobject(5,4,9,"רק השמר לך ושמר נפשך מאד פן תשכח את הדברים אשר ראו עיניך ופן יסורו מלבבך כל ימי חייך והודעתם לבניך ולבני בניך׃"));
hebsuperobject.biblemap.put("b5_4_10", new hebsuperobject(5,4,10,"יום אשר עמדת לפני יהוה אלהיך בחרב באמר יהוה אלי הקהל לי את העם ואשמעם את דברי אשר ילמדון ליראה אתי כל הימים אשר הם חיים על האדמה ואת בניהם ילמדון׃"));
hebsuperobject.biblemap.put("b5_4_11", new hebsuperobject(5,4,11,"ותקרבון ותעמדון תחת ההר וההר בער באש עד לב השמים חשך ענן וערפל׃"));
hebsuperobject.biblemap.put("b5_4_12", new hebsuperobject(5,4,12,"וידבר יהוה אליכם מתוך האש קול דברים אתם שמעים ותמונה אינכם ראים זולתי קול׃"));
hebsuperobject.biblemap.put("b5_4_13", new hebsuperobject(5,4,13,"ויגד לכם את בריתו אשר צוה אתכם לעשות עשרת הדברים ויכתבם על שני לחות אבנים׃"));
hebsuperobject.biblemap.put("b5_4_14", new hebsuperobject(5,4,14,"ואתי צוה יהוה בעת ההוא ללמד אתכם חקים ומשפטים לעשתכם אתם בארץ אשר אתם עברים שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_4_15", new hebsuperobject(5,4,15,"ונשמרתם מאד לנפשתיכם כי לא ראיתם כל תמונה ביום דבר יהוה אליכם בחרב מתוך האש׃"));
hebsuperobject.biblemap.put("b5_4_16", new hebsuperobject(5,4,16,"פן תשחתון ועשיתם לכם פסל תמונת כל סמל תבנית זכר או נקבה׃"));
hebsuperobject.biblemap.put("b5_4_17", new hebsuperobject(5,4,17,"תבנית כל בהמה אשר בארץ תבנית כל צפור כנף אשר תעוף בשמים׃"));
hebsuperobject.biblemap.put("b5_4_18", new hebsuperobject(5,4,18,"תבנית כל רמש באדמה תבנית כל דגה אשר במים מתחת לארץ׃"));
hebsuperobject.biblemap.put("b5_4_19", new hebsuperobject(5,4,19,"ופן תשא עיניך השמימה וראית את השמש ואת הירח ואת הכוכבים כל צבא השמים ונדחת והשתחוית להם ועבדתם אשר חלק יהוה אלהיך אתם לכל העמים תחת כל השמים׃"));
hebsuperobject.biblemap.put("b5_4_20", new hebsuperobject(5,4,20,"ואתכם לקח יהוה ויוצא אתכם מכור הברזל ממצרים להיות לו לעם נחלה כיום הזה׃"));
hebsuperobject.biblemap.put("b5_4_21", new hebsuperobject(5,4,21,"ויהוה התאנף בי על דבריכם וישבע לבלתי עברי את הירדן ולבלתי בא אל הארץ הטובה אשר יהוה אלהיך נתן לך נחלה׃"));
hebsuperobject.biblemap.put("b5_4_22", new hebsuperobject(5,4,22,"כי אנכי מת בארץ הזאת אינני עבר את הירדן ואתם עברים וירשתם את הארץ הטובה הזאת׃"));
hebsuperobject.biblemap.put("b5_4_23", new hebsuperobject(5,4,23,"השמרו לכם פן תשכחו את ברית יהוה אלהיכם אשר כרת עמכם ועשיתם לכם פסל תמונת כל אשר צוך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_4_24", new hebsuperobject(5,4,24,"כי יהוה אלהיך אש אכלה הוא אל קנא׃"));
hebsuperobject.biblemap.put("b5_4_25", new hebsuperobject(5,4,25,"כי תוליד בנים ובני בנים ונושנתם בארץ והשחתם ועשיתם פסל תמונת כל ועשיתם הרע בעיני יהוה אלהיך להכעיסו׃"));
hebsuperobject.biblemap.put("b5_4_26", new hebsuperobject(5,4,26,"העידתי בכם היום את השמים ואת הארץ כי אבד תאבדון מהר מעל הארץ אשר אתם עברים את הירדן שמה לרשתה לא תאריכן ימים עליה כי השמד תשמדון׃"));
hebsuperobject.biblemap.put("b5_4_27", new hebsuperobject(5,4,27,"והפיץ יהוה אתכם בעמים ונשארתם מתי מספר בגוים אשר ינהג יהוה אתכם שמה׃"));
hebsuperobject.biblemap.put("b5_4_28", new hebsuperobject(5,4,28,"ועבדתם שם אלהים מעשה ידי אדם עץ ואבן אשר לא יראון ולא ישמעון ולא יאכלון ולא יריחן׃"));
hebsuperobject.biblemap.put("b5_4_29", new hebsuperobject(5,4,29,"ובקשתם משם את יהוה אלהיך ומצאת כי תדרשנו בכל לבבך ובכל נפשך׃"));
hebsuperobject.biblemap.put("b5_4_30", new hebsuperobject(5,4,30,"בצר לך ומצאוך כל הדברים האלה באחרית הימים ושבת עד יהוה אלהיך ושמעת בקלו׃"));
hebsuperobject.biblemap.put("b5_4_31", new hebsuperobject(5,4,31,"כי אל רחום יהוה אלהיך לא ירפך ולא ישחיתך ולא ישכח את ברית אבתיך אשר נשבע להם׃"));
hebsuperobject.biblemap.put("b5_4_32", new hebsuperobject(5,4,32,"כי שאל נא לימים ראשנים אשר היו לפניך למן היום אשר ברא אלהים אדם על הארץ ולמקצה השמים ועד קצה השמים הנהיה כדבר הגדול הזה או הנשמע כמהו׃"));
hebsuperobject.biblemap.put("b5_4_33", new hebsuperobject(5,4,33,"השמע עם קול אלהים מדבר מתוך האש כאשר שמעת אתה ויחי׃"));
hebsuperobject.biblemap.put("b5_4_34", new hebsuperobject(5,4,34,"או הנסה אלהים לבוא לקחת לו גוי מקרב גוי במסת באתת ובמופתים ובמלחמה וביד חזקה ובזרוע נטויה ובמוראים גדלים ככל אשר עשה לכם יהוה אלהיכם במצרים לעיניך׃"));
hebsuperobject.biblemap.put("b5_4_35", new hebsuperobject(5,4,35,"אתה הראת לדעת כי יהוה הוא האלהים אין עוד מלבדו׃"));
hebsuperobject.biblemap.put("b5_4_36", new hebsuperobject(5,4,36,"מן השמים השמיעך את קלו ליסרך ועל הארץ הראך את אשו הגדולה ודבריו שמעת מתוך האש׃"));
hebsuperobject.biblemap.put("b5_4_37", new hebsuperobject(5,4,37,"ותחת כי אהב את אבתיך ויבחר בזרעו אחריו ויוצאך בפניו בכחו הגדל ממצרים׃"));
hebsuperobject.biblemap.put("b5_4_38", new hebsuperobject(5,4,38,"להוריש גוים גדלים ועצמים ממך מפניך להביאך לתת לך את ארצם נחלה כיום הזה׃"));
hebsuperobject.biblemap.put("b5_4_39", new hebsuperobject(5,4,39,"וידעת היום והשבת אל לבבך כי יהוה הוא האלהים בשמים ממעל ועל הארץ מתחת אין עוד׃"));
hebsuperobject.biblemap.put("b5_4_40", new hebsuperobject(5,4,40,"ושמרת את חקיו ואת מצותיו אשר אנכי מצוך היום אשר ייטב לך ולבניך אחריך ולמען תאריך ימים על האדמה אשר יהוה אלהיך נתן לך כל הימים׃"));
hebsuperobject.biblemap.put("b5_4_41", new hebsuperobject(5,4,41,"אז יבדיל משה שלש ערים בעבר הירדן מזרחה שמש׃"));
hebsuperobject.biblemap.put("b5_4_42", new hebsuperobject(5,4,42,"לנס שמה רוצח אשר ירצח את רעהו בבלי דעת והוא לא שנא לו מתמול שלשום ונס אל אחת מן הערים האל וחי׃"));
hebsuperobject.biblemap.put("b5_4_43", new hebsuperobject(5,4,43,"את בצר במדבר בארץ המישר לראובני ואת ראמת בגלעד לגדי ואת גולן בבשן למנשי׃"));
hebsuperobject.biblemap.put("b5_4_44", new hebsuperobject(5,4,44,"וזאת התורה אשר שם משה לפני בני ישראל׃"));
hebsuperobject.biblemap.put("b5_4_45", new hebsuperobject(5,4,45,"אלה העדת והחקים והמשפטים אשר דבר משה אל בני ישראל בצאתם ממצרים׃"));
hebsuperobject.biblemap.put("b5_4_46", new hebsuperobject(5,4,46,"בעבר הירדן בגיא מול בית פעור בארץ סיחן מלך האמרי אשר יושב בחשבון אשר הכה משה ובני ישראל בצאתם ממצרים׃"));
hebsuperobject.biblemap.put("b5_4_47", new hebsuperobject(5,4,47,"ויירשו את ארצו ואת ארץ עוג מלך הבשן שני מלכי האמרי אשר בעבר הירדן מזרח שמש׃"));
hebsuperobject.biblemap.put("b5_4_48", new hebsuperobject(5,4,48,"מערער אשר על שפת נחל ארנן ועד הר שיאן הוא חרמון׃"));
hebsuperobject.biblemap.put("b5_4_49", new hebsuperobject(5,4,49,"וכל הערבה עבר הירדן מזרחה ועד ים הערבה תחת אשדת הפסגה׃"));
hebsuperobject.biblemap.put("b5_5_1", new hebsuperobject(5,5,1,"ויקרא משה אל כל ישראל ויאמר אלהם שמע ישראל את החקים ואת המשפטים אשר אנכי דבר באזניכם היום ולמדתם אתם ושמרתם לעשתם׃"));
hebsuperobject.biblemap.put("b5_5_2", new hebsuperobject(5,5,2,"יהוה אלהינו כרת עמנו ברית בחרב׃"));
hebsuperobject.biblemap.put("b5_5_3", new hebsuperobject(5,5,3,"לא את אבתינו כרת יהוה את הברית הזאת כי אתנו אנחנו אלה פה היום כלנו חיים׃"));
hebsuperobject.biblemap.put("b5_5_4", new hebsuperobject(5,5,4,"פנים בפנים דבר יהוה עמכם בהר מתוך האש׃"));
hebsuperobject.biblemap.put("b5_5_5", new hebsuperobject(5,5,5,"אנכי עמד בין יהוה וביניכם בעת ההוא להגיד לכם את דבר יהוה כי יראתם מפני האש ולא עליתם בהר לאמר׃"));
hebsuperobject.biblemap.put("b5_5_6", new hebsuperobject(5,5,6,"אנכי יהוה אלהיך אשר הוצאתיך מארץ מצרים מבית עבדים׃"));
hebsuperobject.biblemap.put("b5_5_7", new hebsuperobject(5,5,7,"לא יהיה לך אלהים אחרים על פני׃"));
hebsuperobject.biblemap.put("b5_5_8", new hebsuperobject(5,5,8,"לא תעשה לך פסל כל תמונה אשר בשמים ממעל ואשר בארץ מתחת ואשר במים מתחת לארץ׃"));
hebsuperobject.biblemap.put("b5_5_9", new hebsuperobject(5,5,9,"לא תשתחוה להם ולא תעבדם כי אנכי יהוה אלהיך אל קנא פקד עון אבות על בנים ועל שלשים ועל רבעים לשנאי׃"));
hebsuperobject.biblemap.put("b5_5_10", new hebsuperobject(5,5,10,"ועשה חסד לאלפים לאהבי ולשמרי מצותו׃"));
hebsuperobject.biblemap.put("b5_5_11", new hebsuperobject(5,5,11,"לא תשא את שם יהוה אלהיך לשוא כי לא ינקה יהוה את אשר ישא את שמו לשוא׃"));
hebsuperobject.biblemap.put("b5_5_12", new hebsuperobject(5,5,12,"שמור את יום השבת לקדשו כאשר צוך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_5_13", new hebsuperobject(5,5,13,"ששת ימים תעבד ועשית כל מלאכתך׃"));
hebsuperobject.biblemap.put("b5_5_14", new hebsuperobject(5,5,14,"ויום השביעי שבת ליהוה אלהיך לא תעשה כל מלאכה אתה ובנך ובתך ועבדך ואמתך ושורך וחמרך וכל בהמתך וגרך אשר בשעריך למען ינוח עבדך ואמתך כמוך׃"));
hebsuperobject.biblemap.put("b5_5_15", new hebsuperobject(5,5,15,"וזכרת כי עבד היית בארץ מצרים ויצאך יהוה אלהיך משם ביד חזקה ובזרע נטויה על כן צוך יהוה אלהיך לעשות את יום השבת׃"));
hebsuperobject.biblemap.put("b5_5_16", new hebsuperobject(5,5,16,"כבד את אביך ואת אמך כאשר צוך יהוה אלהיך למען יאריכן ימיך ולמען ייטב לך על האדמה אשר יהוה אלהיך נתן לך׃"));
hebsuperobject.biblemap.put("b5_5_17", new hebsuperobject(5,5,17,"לא תרצח׃"));
hebsuperobject.biblemap.put("b5_5_18", new hebsuperobject(5,5,18,"ולא תנאף׃"));
hebsuperobject.biblemap.put("b5_5_19", new hebsuperobject(5,5,19,"ולא תגנב׃"));
hebsuperobject.biblemap.put("b5_5_20", new hebsuperobject(5,5,20,"ולא תענה ברעך עד שוא׃"));
hebsuperobject.biblemap.put("b5_5_21", new hebsuperobject(5,5,21,"ולא תחמד אשת רעך ולא תתאוה בית רעך שדהו ועבדו ואמתו שורו וחמרו וכל אשר לרעך׃"));
hebsuperobject.biblemap.put("b5_5_22", new hebsuperobject(5,5,22,"את הדברים האלה דבר יהוה אל כל קהלכם בהר מתוך האש הענן והערפל קול גדול ולא יסף ויכתבם על שני לחת אבנים ויתנם אלי׃"));
hebsuperobject.biblemap.put("b5_5_23", new hebsuperobject(5,5,23,"ויהי כשמעכם את הקול מתוך החשך וההר בער באש ותקרבון אלי כל ראשי שבטיכם וזקניכם׃"));
hebsuperobject.biblemap.put("b5_5_24", new hebsuperobject(5,5,24,"ותאמרו הן הראנו יהוה אלהינו את כבדו ואת גדלו ואת קלו שמענו מתוך האש היום הזה ראינו כי ידבר אלהים את האדם וחי׃"));
hebsuperobject.biblemap.put("b5_5_25", new hebsuperobject(5,5,25,"ועתה למה נמות כי תאכלנו האש הגדלה הזאת אם יספים אנחנו לשמע את קול יהוה אלהינו עוד ומתנו׃"));
hebsuperobject.biblemap.put("b5_5_26", new hebsuperobject(5,5,26,"כי מי כל בשר אשר שמע קול אלהים חיים מדבר מתוך האש כמנו ויחי׃"));
hebsuperobject.biblemap.put("b5_5_27", new hebsuperobject(5,5,27,"קרב אתה ושמע את כל אשר יאמר יהוה אלהינו ואת תדבר אלינו את כל אשר ידבר יהוה אלהינו אליך ושמענו ועשינו׃"));
hebsuperobject.biblemap.put("b5_5_28", new hebsuperobject(5,5,28,"וישמע יהוה את קול דבריכם בדברכם אלי ויאמר יהוה אלי שמעתי את קול דברי העם הזה אשר דברו אליך היטיבו כל אשר דברו׃"));
hebsuperobject.biblemap.put("b5_5_29", new hebsuperobject(5,5,29,"מי יתן והיה לבבם זה להם ליראה אתי ולשמר את כל מצותי כל הימים למען ייטב להם ולבניהם לעלם׃"));
hebsuperobject.biblemap.put("b5_5_30", new hebsuperobject(5,5,30,"לך אמר להם שובו לכם לאהליכם׃"));
hebsuperobject.biblemap.put("b5_5_31", new hebsuperobject(5,5,31,"ואתה פה עמד עמדי ואדברה אליך את כל המצוה והחקים והמשפטים אשר תלמדם ועשו בארץ אשר אנכי נתן להם לרשתה׃"));
hebsuperobject.biblemap.put("b5_5_32", new hebsuperobject(5,5,32,"ושמרתם לעשות כאשר צוה יהוה אלהיכם אתכם לא תסרו ימין ושמאל׃"));
hebsuperobject.biblemap.put("b5_5_33", new hebsuperobject(5,5,33,"בכל הדרך אשר צוה יהוה אלהיכם אתכם תלכו למען תחיון וטוב לכם והארכתם ימים בארץ אשר תירשון׃"));
hebsuperobject.biblemap.put("b5_6_1", new hebsuperobject(5,6,1,"וזאת המצוה החקים והמשפטים אשר צוה יהוה אלהיכם ללמד אתכם לעשות בארץ אשר אתם עברים שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_6_2", new hebsuperobject(5,6,2,"למען תירא את יהוה אלהיך לשמר את כל חקתיו ומצותיו אשר אנכי מצוך אתה ובנך ובן בנך כל ימי חייך ולמען יארכן ימיך׃"));
hebsuperobject.biblemap.put("b5_6_3", new hebsuperobject(5,6,3,"ושמעת ישראל ושמרת לעשות אשר ייטב לך ואשר תרבון מאד כאשר דבר יהוה אלהי אבתיך לך ארץ זבת חלב ודבש׃"));
hebsuperobject.biblemap.put("b5_6_4", new hebsuperobject(5,6,4,"שמע ישראל יהוה אלהינו יהוה אחד׃"));
hebsuperobject.biblemap.put("b5_6_5", new hebsuperobject(5,6,5,"ואהבת את יהוה אלהיך בכל לבבך ובכל נפשך ובכל מאדך׃"));
hebsuperobject.biblemap.put("b5_6_6", new hebsuperobject(5,6,6,"והיו הדברים האלה אשר אנכי מצוך היום על לבבך׃"));
hebsuperobject.biblemap.put("b5_6_7", new hebsuperobject(5,6,7,"ושננתם לבניך ודברת בם בשבתך בביתך ובלכתך בדרך ובשכבך ובקומך׃"));
hebsuperobject.biblemap.put("b5_6_8", new hebsuperobject(5,6,8,"וקשרתם לאות על ידך והיו לטטפת בין עיניך׃"));
hebsuperobject.biblemap.put("b5_6_9", new hebsuperobject(5,6,9,"וכתבתם על מזוזת ביתך ובשעריך׃"));
hebsuperobject.biblemap.put("b5_6_10", new hebsuperobject(5,6,10,"והיה כי יביאך יהוה אלהיך אל הארץ אשר נשבע לאבתיך לאברהם ליצחק וליעקב לתת לך ערים גדלת וטבת אשר לא בנית׃"));
hebsuperobject.biblemap.put("b5_6_11", new hebsuperobject(5,6,11,"ובתים מלאים כל טוב אשר לא מלאת וברת חצובים אשר לא חצבת כרמים וזיתים אשר לא נטעת ואכלת ושבעת׃"));
hebsuperobject.biblemap.put("b5_6_12", new hebsuperobject(5,6,12,"השמר לך פן תשכח את יהוה אשר הוציאך מארץ מצרים מבית עבדים׃"));
hebsuperobject.biblemap.put("b5_6_13", new hebsuperobject(5,6,13,"את יהוה אלהיך תירא ואתו תעבד ובשמו תשבע׃"));
hebsuperobject.biblemap.put("b5_6_14", new hebsuperobject(5,6,14,"לא תלכון אחרי אלהים אחרים מאלהי העמים אשר סביבותיכם׃"));
hebsuperobject.biblemap.put("b5_6_15", new hebsuperobject(5,6,15,"כי אל קנא יהוה אלהיך בקרבך פן יחרה אף יהוה אלהיך בך והשמידך מעל פני האדמה׃"));
hebsuperobject.biblemap.put("b5_6_16", new hebsuperobject(5,6,16,"לא תנסו את יהוה אלהיכם כאשר נסיתם במסה׃"));
hebsuperobject.biblemap.put("b5_6_17", new hebsuperobject(5,6,17,"שמור תשמרון את מצות יהוה אלהיכם ועדתיו וחקיו אשר צוך׃"));
hebsuperobject.biblemap.put("b5_6_18", new hebsuperobject(5,6,18,"ועשית הישר והטוב בעיני יהוה למען ייטב לך ובאת וירשת את הארץ הטבה אשר נשבע יהוה לאבתיך׃"));
hebsuperobject.biblemap.put("b5_6_19", new hebsuperobject(5,6,19,"להדף את כל איביך מפניך כאשר דבר יהוה׃"));
hebsuperobject.biblemap.put("b5_6_20", new hebsuperobject(5,6,20,"כי ישאלך בנך מחר לאמר מה העדת והחקים והמשפטים אשר צוה יהוה אלהינו אתכם׃"));
hebsuperobject.biblemap.put("b5_6_21", new hebsuperobject(5,6,21,"ואמרת לבנך עבדים היינו לפרעה במצרים ויוציאנו יהוה ממצרים ביד חזקה׃"));
hebsuperobject.biblemap.put("b5_6_22", new hebsuperobject(5,6,22,"ויתן יהוה אותת ומפתים גדלים ורעים במצרים בפרעה ובכל ביתו לעינינו׃"));
hebsuperobject.biblemap.put("b5_6_23", new hebsuperobject(5,6,23,"ואותנו הוציא משם למען הביא אתנו לתת לנו את הארץ אשר נשבע לאבתינו׃"));
hebsuperobject.biblemap.put("b5_6_24", new hebsuperobject(5,6,24,"ויצונו יהוה לעשות את כל החקים האלה ליראה את יהוה אלהינו לטוב לנו כל הימים לחיתנו כהיום הזה׃"));
hebsuperobject.biblemap.put("b5_6_25", new hebsuperobject(5,6,25,"וצדקה תהיה לנו כי נשמר לעשות את כל המצוה הזאת לפני יהוה אלהינו כאשר צונו׃"));
hebsuperobject.biblemap.put("b5_7_1", new hebsuperobject(5,7,1,"כי יביאך יהוה אלהיך אל הארץ אשר אתה בא שמה לרשתה ונשל גוים רבים מפניך החתי והגרגשי והאמרי והכנעני והפרזי והחוי והיבוסי שבעה גוים רבים ועצומים ממך׃"));
hebsuperobject.biblemap.put("b5_7_2", new hebsuperobject(5,7,2,"ונתנם יהוה אלהיך לפניך והכיתם החרם תחרים אתם לא תכרת להם ברית ולא תחנם׃"));
hebsuperobject.biblemap.put("b5_7_3", new hebsuperobject(5,7,3,"ולא תתחתן בם בתך לא תתן לבנו ובתו לא תקח לבנך׃"));
hebsuperobject.biblemap.put("b5_7_4", new hebsuperobject(5,7,4,"כי יסיר את בנך מאחרי ועבדו אלהים אחרים וחרה אף יהוה בכם והשמידך מהר׃"));
hebsuperobject.biblemap.put("b5_7_5", new hebsuperobject(5,7,5,"כי אם כה תעשו להם מזבחתיהם תתצו ומצבתם תשברו ואשירהם תגדעון ופסיליהם תשרפון באש׃"));
hebsuperobject.biblemap.put("b5_7_6", new hebsuperobject(5,7,6,"כי עם קדוש אתה ליהוה אלהיך בך בחר יהוה אלהיך להיות לו לעם סגלה מכל העמים אשר על פני האדמה׃"));
hebsuperobject.biblemap.put("b5_7_7", new hebsuperobject(5,7,7,"לא מרבכם מכל העמים חשק יהוה בכם ויבחר בכם כי אתם המעט מכל העמים׃"));
hebsuperobject.biblemap.put("b5_7_8", new hebsuperobject(5,7,8,"כי מאהבת יהוה אתכם ומשמרו את השבעה אשר נשבע לאבתיכם הוציא יהוה אתכם ביד חזקה ויפדך מבית עבדים מיד פרעה מלך מצרים׃"));
hebsuperobject.biblemap.put("b5_7_9", new hebsuperobject(5,7,9,"וידעת כי יהוה אלהיך הוא האלהים האל הנאמן שמר הברית והחסד לאהביו ולשמרי מצותו לאלף דור׃"));
hebsuperobject.biblemap.put("b5_7_10", new hebsuperobject(5,7,10,"ומשלם לשנאיו אל פניו להאבידו לא יאחר לשנאו אל פניו ישלם לו׃"));
hebsuperobject.biblemap.put("b5_7_11", new hebsuperobject(5,7,11,"ושמרת את המצוה ואת החקים ואת המשפטים אשר אנכי מצוך היום לעשותם׃"));
hebsuperobject.biblemap.put("b5_7_12", new hebsuperobject(5,7,12,"והיה עקב תשמעון את המשפטים האלה ושמרתם ועשיתם אתם ושמר יהוה אלהיך לך את הברית ואת החסד אשר נשבע לאבתיך׃"));
hebsuperobject.biblemap.put("b5_7_13", new hebsuperobject(5,7,13,"ואהבך וברכך והרבך וברך פרי בטנך ופרי אדמתך דגנך ותירשך ויצהרך שגר אלפיך ועשתרת צאנך על האדמה אשר נשבע לאבתיך לתת לך׃"));
hebsuperobject.biblemap.put("b5_7_14", new hebsuperobject(5,7,14,"ברוך תהיה מכל העמים לא יהיה בך עקר ועקרה ובבהמתך׃"));
hebsuperobject.biblemap.put("b5_7_15", new hebsuperobject(5,7,15,"והסיר יהוה ממך כל חלי וכל מדוי מצרים הרעים אשר ידעת לא ישימם בך ונתנם בכל שנאיך׃"));
hebsuperobject.biblemap.put("b5_7_16", new hebsuperobject(5,7,16,"ואכלת את כל העמים אשר יהוה אלהיך נתן לך לא תחס עינך עליהם ולא תעבד את אלהיהם כי מוקש הוא לך׃"));
hebsuperobject.biblemap.put("b5_7_17", new hebsuperobject(5,7,17,"כי תאמר בלבבך רבים הגוים האלה ממני איכה אוכל להורישם׃"));
hebsuperobject.biblemap.put("b5_7_18", new hebsuperobject(5,7,18,"לא תירא מהם זכר תזכר את אשר עשה יהוה אלהיך לפרעה ולכל מצרים׃"));
hebsuperobject.biblemap.put("b5_7_19", new hebsuperobject(5,7,19,"המסת הגדלת אשר ראו עיניך והאתת והמפתים והיד החזקה והזרע הנטויה אשר הוצאך יהוה אלהיך כן יעשה יהוה אלהיך לכל העמים אשר אתה ירא מפניהם׃"));
hebsuperobject.biblemap.put("b5_7_20", new hebsuperobject(5,7,20,"וגם את הצרעה ישלח יהוה אלהיך בם עד אבד הנשארים והנסתרים מפניך׃"));
hebsuperobject.biblemap.put("b5_7_21", new hebsuperobject(5,7,21,"לא תערץ מפניהם כי יהוה אלהיך בקרבך אל גדול ונורא׃"));
hebsuperobject.biblemap.put("b5_7_22", new hebsuperobject(5,7,22,"ונשל יהוה אלהיך את הגוים האל מפניך מעט מעט לא תוכל כלתם מהר פן תרבה עליך חית השדה׃"));
hebsuperobject.biblemap.put("b5_7_23", new hebsuperobject(5,7,23,"ונתנם יהוה אלהיך לפניך והמם מהומה גדלה עד השמדם׃"));
hebsuperobject.biblemap.put("b5_7_24", new hebsuperobject(5,7,24,"ונתן מלכיהם בידך והאבדת את שמם מתחת השמים לא יתיצב איש בפניך עד השמדך אתם׃"));
hebsuperobject.biblemap.put("b5_7_25", new hebsuperobject(5,7,25,"פסילי אלהיהם תשרפון באש לא תחמד כסף וזהב עליהם ולקחת לך פן תוקש בו כי תועבת יהוה אלהיך הוא׃"));
hebsuperobject.biblemap.put("b5_7_26", new hebsuperobject(5,7,26,"ולא תביא תועבה אל ביתך והיית חרם כמהו שקץ תשקצנו ותעב תתעבנו כי חרם הוא׃"));
hebsuperobject.biblemap.put("b5_8_1", new hebsuperobject(5,8,1,"כל המצוה אשר אנכי מצוך היום תשמרון לעשות למען תחיון ורביתם ובאתם וירשתם את הארץ אשר נשבע יהוה לאבתיכם׃"));
hebsuperobject.biblemap.put("b5_8_2", new hebsuperobject(5,8,2,"וזכרת את כל הדרך אשר הליכך יהוה אלהיך זה ארבעים שנה במדבר למען ענתך לנסתך לדעת את אשר בלבבך התשמר מצותו אם לא׃"));
hebsuperobject.biblemap.put("b5_8_3", new hebsuperobject(5,8,3,"ויענך וירעבך ויאכלך את המן אשר לא ידעת ולא ידעון אבתיך למען הודעך כי לא על הלחם לבדו יחיה האדם כי על כל מוצא פי יהוה יחיה האדם׃"));
hebsuperobject.biblemap.put("b5_8_4", new hebsuperobject(5,8,4,"שמלתך לא בלתה מעליך ורגלך לא בצקה זה ארבעים שנה׃"));
hebsuperobject.biblemap.put("b5_8_5", new hebsuperobject(5,8,5,"וידעת עם לבבך כי כאשר ייסר איש את בנו יהוה אלהיך מיסרך׃"));
hebsuperobject.biblemap.put("b5_8_6", new hebsuperobject(5,8,6,"ושמרת את מצות יהוה אלהיך ללכת בדרכיו וליראה אתו׃"));
hebsuperobject.biblemap.put("b5_8_7", new hebsuperobject(5,8,7,"כי יהוה אלהיך מביאך אל ארץ טובה ארץ נחלי מים עינת ותהמת יצאים בבקעה ובהר׃"));
hebsuperobject.biblemap.put("b5_8_8", new hebsuperobject(5,8,8,"ארץ חטה ושערה וגפן ותאנה ורמון ארץ זית שמן ודבש׃"));
hebsuperobject.biblemap.put("b5_8_9", new hebsuperobject(5,8,9,"ארץ אשר לא במסכנת תאכל בה לחם לא תחסר כל בה ארץ אשר אבניה ברזל ומהרריה תחצב נחשת׃"));
hebsuperobject.biblemap.put("b5_8_10", new hebsuperobject(5,8,10,"ואכלת ושבעת וברכת את יהוה אלהיך על הארץ הטבה אשר נתן לך׃"));
hebsuperobject.biblemap.put("b5_8_11", new hebsuperobject(5,8,11,"השמר לך פן תשכח את יהוה אלהיך לבלתי שמר מצותיו ומשפטיו וחקתיו אשר אנכי מצוך היום׃"));
hebsuperobject.biblemap.put("b5_8_12", new hebsuperobject(5,8,12,"פן תאכל ושבעת ובתים טובים תבנה וישבת׃"));
hebsuperobject.biblemap.put("b5_8_13", new hebsuperobject(5,8,13,"ובקרך וצאנך ירבין וכסף וזהב ירבה לך וכל אשר לך ירבה׃"));
hebsuperobject.biblemap.put("b5_8_14", new hebsuperobject(5,8,14,"ורם לבבך ושכחת את יהוה אלהיך המוציאך מארץ מצרים מבית עבדים׃"));
hebsuperobject.biblemap.put("b5_8_15", new hebsuperobject(5,8,15,"המוליכך במדבר הגדל והנורא נחש שרף ועקרב וצמאון אשר אין מים המוציא לך מים מצור החלמיש׃"));
hebsuperobject.biblemap.put("b5_8_16", new hebsuperobject(5,8,16,"המאכלך מן במדבר אשר לא ידעון אבתיך למען ענתך ולמען נסתך להיטבך באחריתך׃"));
hebsuperobject.biblemap.put("b5_8_17", new hebsuperobject(5,8,17,"ואמרת בלבבך כחי ועצם ידי עשה לי את החיל הזה׃"));
hebsuperobject.biblemap.put("b5_8_18", new hebsuperobject(5,8,18,"וזכרת את יהוה אלהיך כי הוא הנתן לך כח לעשות חיל למען הקים את בריתו אשר נשבע לאבתיך כיום הזה׃"));
hebsuperobject.biblemap.put("b5_8_19", new hebsuperobject(5,8,19,"והיה אם שכח תשכח את יהוה אלהיך והלכת אחרי אלהים אחרים ועבדתם והשתחוית להם העדתי בכם היום כי אבד תאבדון׃"));
hebsuperobject.biblemap.put("b5_8_20", new hebsuperobject(5,8,20,"כגוים אשר יהוה מאביד מפניכם כן תאבדון עקב לא תשמעון בקול יהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b5_9_1", new hebsuperobject(5,9,1,"שמע ישראל אתה עבר היום את הירדן לבא לרשת גוים גדלים ועצמים ממך ערים גדלת ובצרת בשמים׃"));
hebsuperobject.biblemap.put("b5_9_2", new hebsuperobject(5,9,2,"עם גדול ורם בני ענקים אשר אתה ידעת ואתה שמעת מי יתיצב לפני בני ענק׃"));
hebsuperobject.biblemap.put("b5_9_3", new hebsuperobject(5,9,3,"וידעת היום כי יהוה אלהיך הוא העבר לפניך אש אכלה הוא ישמידם והוא יכניעם לפניך והורשתם והאבדתם מהר כאשר דבר יהוה לך׃"));
hebsuperobject.biblemap.put("b5_9_4", new hebsuperobject(5,9,4,"אל תאמר בלבבך בהדף יהוה אלהיך אתם מלפניך לאמר בצדקתי הביאני יהוה לרשת את הארץ הזאת וברשעת הגוים האלה יהוה מורישם מפניך׃"));
hebsuperobject.biblemap.put("b5_9_5", new hebsuperobject(5,9,5,"לא בצדקתך ובישר לבבך אתה בא לרשת את ארצם כי ברשעת הגוים האלה יהוה אלהיך מורישם מפניך ולמען הקים את הדבר אשר נשבע יהוה לאבתיך לאברהם ליצחק וליעקב׃"));
hebsuperobject.biblemap.put("b5_9_6", new hebsuperobject(5,9,6,"וידעת כי לא בצדקתך יהוה אלהיך נתן לך את הארץ הטובה הזאת לרשתה כי עם קשה ערף אתה׃"));
hebsuperobject.biblemap.put("b5_9_7", new hebsuperobject(5,9,7,"זכר אל תשכח את אשר הקצפת את יהוה אלהיך במדבר למן היום אשר יצאת מארץ מצרים עד באכם עד המקום הזה ממרים הייתם עם יהוה׃"));
hebsuperobject.biblemap.put("b5_9_8", new hebsuperobject(5,9,8,"ובחרב הקצפתם את יהוה ויתאנף יהוה בכם להשמיד אתכם׃"));
hebsuperobject.biblemap.put("b5_9_9", new hebsuperobject(5,9,9,"בעלתי ההרה לקחת לוחת האבנים לוחת הברית אשר כרת יהוה עמכם ואשב בהר ארבעים יום וארבעים לילה לחם לא אכלתי ומים לא שתיתי׃"));
hebsuperobject.biblemap.put("b5_9_10", new hebsuperobject(5,9,10,"ויתן יהוה אלי את שני לוחת האבנים כתבים באצבע אלהים ועליהם ככל הדברים אשר דבר יהוה עמכם בהר מתוך האש ביום הקהל׃"));
hebsuperobject.biblemap.put("b5_9_11", new hebsuperobject(5,9,11,"ויהי מקץ ארבעים יום וארבעים לילה נתן יהוה אלי את שני לחת האבנים לחות הברית׃"));
hebsuperobject.biblemap.put("b5_9_12", new hebsuperobject(5,9,12,"ויאמר יהוה אלי קום רד מהר מזה כי שחת עמך אשר הוצאת ממצרים סרו מהר מן הדרך אשר צויתם עשו להם מסכה׃"));
hebsuperobject.biblemap.put("b5_9_13", new hebsuperobject(5,9,13,"ויאמר יהוה אלי לאמר ראיתי את העם הזה והנה עם קשה ערף הוא׃"));
hebsuperobject.biblemap.put("b5_9_14", new hebsuperobject(5,9,14,"הרף ממני ואשמידם ואמחה את שמם מתחת השמים ואעשה אותך לגוי עצום ורב ממנו׃"));
hebsuperobject.biblemap.put("b5_9_15", new hebsuperobject(5,9,15,"ואפן וארד מן ההר וההר בער באש ושני לחת הברית על שתי ידי׃"));
hebsuperobject.biblemap.put("b5_9_16", new hebsuperobject(5,9,16,"וארא והנה חטאתם ליהוה אלהיכם עשיתם לכם עגל מסכה סרתם מהר מן הדרך אשר צוה יהוה אתכם׃"));
hebsuperobject.biblemap.put("b5_9_17", new hebsuperobject(5,9,17,"ואתפש בשני הלחת ואשלכם מעל שתי ידי ואשברם לעיניכם׃"));
hebsuperobject.biblemap.put("b5_9_18", new hebsuperobject(5,9,18,"ואתנפל לפני יהוה כראשנה ארבעים יום וארבעים לילה לחם לא אכלתי ומים לא שתיתי על כל חטאתכם אשר חטאתם לעשות הרע בעיני יהוה להכעיסו׃"));
hebsuperobject.biblemap.put("b5_9_19", new hebsuperobject(5,9,19,"כי יגרתי מפני האף והחמה אשר קצף יהוה עליכם להשמיד אתכם וישמע יהוה אלי גם בפעם ההוא׃"));
hebsuperobject.biblemap.put("b5_9_20", new hebsuperobject(5,9,20,"ובאהרן התאנף יהוה מאד להשמידו ואתפלל גם בעד אהרן בעת ההוא׃"));
hebsuperobject.biblemap.put("b5_9_21", new hebsuperobject(5,9,21,"ואת חטאתכם אשר עשיתם את העגל לקחתי ואשרף אתו באש ואכת אתו טחון היטב עד אשר דק לעפר ואשלך את עפרו אל הנחל הירד מן ההר׃"));
hebsuperobject.biblemap.put("b5_9_22", new hebsuperobject(5,9,22,"ובתבערה ובמסה ובקברת התאוה מקצפים הייתם את יהוה׃"));
hebsuperobject.biblemap.put("b5_9_23", new hebsuperobject(5,9,23,"ובשלח יהוה אתכם מקדש ברנע לאמר עלו ורשו את הארץ אשר נתתי לכם ותמרו את פי יהוה אלהיכם ולא האמנתם לו ולא שמעתם בקלו׃"));
hebsuperobject.biblemap.put("b5_9_24", new hebsuperobject(5,9,24,"ממרים הייתם עם יהוה מיום דעתי אתכם׃"));
hebsuperobject.biblemap.put("b5_9_25", new hebsuperobject(5,9,25,"ואתנפל לפני יהוה את ארבעים היום ואת ארבעים הלילה אשר התנפלתי כי אמר יהוה להשמיד אתכם׃"));
hebsuperobject.biblemap.put("b5_9_26", new hebsuperobject(5,9,26,"ואתפלל אל יהוה ואמר אדני יהוה אל תשחת עמך ונחלתך אשר פדית בגדלך אשר הוצאת ממצרים ביד חזקה׃"));
hebsuperobject.biblemap.put("b5_9_27", new hebsuperobject(5,9,27,"זכר לעבדיך לאברהם ליצחק וליעקב אל תפן אל קשי העם הזה ואל רשעו ואל חטאתו׃"));
hebsuperobject.biblemap.put("b5_9_28", new hebsuperobject(5,9,28,"פן יאמרו הארץ אשר הוצאתנו משם מבלי יכלת יהוה להביאם אל הארץ אשר דבר להם ומשנאתו אותם הוציאם להמתם במדבר׃"));
hebsuperobject.biblemap.put("b5_9_29", new hebsuperobject(5,9,29,"והם עמך ונחלתך אשר הוצאת בכחך הגדל ובזרעך הנטויה׃"));
hebsuperobject.biblemap.put("b5_10_1", new hebsuperobject(5,10,1,"בעת ההוא אמר יהוה אלי פסל לך שני לוחת אבנים כראשנים ועלה אלי ההרה ועשית לך ארון עץ׃"));
hebsuperobject.biblemap.put("b5_10_2", new hebsuperobject(5,10,2,"ואכתב על הלחת את הדברים אשר היו על הלחת הראשנים אשר שברת ושמתם בארון׃"));
hebsuperobject.biblemap.put("b5_10_3", new hebsuperobject(5,10,3,"ואעש ארון עצי שטים ואפסל שני לחת אבנים כראשנים ואעל ההרה ושני הלחת בידי׃"));
hebsuperobject.biblemap.put("b5_10_4", new hebsuperobject(5,10,4,"ויכתב על הלחת כמכתב הראשון את עשרת הדברים אשר דבר יהוה אליכם בהר מתוך האש ביום הקהל ויתנם יהוה אלי׃"));
hebsuperobject.biblemap.put("b5_10_5", new hebsuperobject(5,10,5,"ואפן וארד מן ההר ואשם את הלחת בארון אשר עשיתי ויהיו שם כאשר צוני יהוה׃"));
hebsuperobject.biblemap.put("b5_10_6", new hebsuperobject(5,10,6,"ובני ישראל נסעו מבארת בני יעקן מוסרה שם מת אהרן ויקבר שם ויכהן אלעזר בנו תחתיו׃"));
hebsuperobject.biblemap.put("b5_10_7", new hebsuperobject(5,10,7,"משם נסעו הגדגדה ומן הגדגדה יטבתה ארץ נחלי מים׃"));
hebsuperobject.biblemap.put("b5_10_8", new hebsuperobject(5,10,8,"בעת ההוא הבדיל יהוה את שבט הלוי לשאת את ארון ברית יהוה לעמד לפני יהוה לשרתו ולברך בשמו עד היום הזה׃"));
hebsuperobject.biblemap.put("b5_10_9", new hebsuperobject(5,10,9,"על כן לא היה ללוי חלק ונחלה עם אחיו יהוה הוא נחלתו כאשר דבר יהוה אלהיך לו׃"));
hebsuperobject.biblemap.put("b5_10_10", new hebsuperobject(5,10,10,"ואנכי עמדתי בהר כימים הראשנים ארבעים יום וארבעים לילה וישמע יהוה אלי גם בפעם ההוא לא אבה יהוה השחיתך׃"));
hebsuperobject.biblemap.put("b5_10_11", new hebsuperobject(5,10,11,"ויאמר יהוה אלי קום לך למסע לפני העם ויבאו וירשו את הארץ אשר נשבעתי לאבתם לתת להם׃"));
hebsuperobject.biblemap.put("b5_10_12", new hebsuperobject(5,10,12,"ועתה ישראל מה יהוה אלהיך שאל מעמך כי אם ליראה את יהוה אלהיך ללכת בכל דרכיו ולאהבה אתו ולעבד את יהוה אלהיך בכל לבבך ובכל נפשך׃"));
hebsuperobject.biblemap.put("b5_10_13", new hebsuperobject(5,10,13,"לשמר את מצות יהוה ואת חקתיו אשר אנכי מצוך היום לטוב לך׃"));
hebsuperobject.biblemap.put("b5_10_14", new hebsuperobject(5,10,14,"הן ליהוה אלהיך השמים ושמי השמים הארץ וכל אשר בה׃"));
hebsuperobject.biblemap.put("b5_10_15", new hebsuperobject(5,10,15,"רק באבתיך חשק יהוה לאהבה אותם ויבחר בזרעם אחריהם בכם מכל העמים כיום הזה׃"));
hebsuperobject.biblemap.put("b5_10_16", new hebsuperobject(5,10,16,"ומלתם את ערלת לבבכם וערפכם לא תקשו עוד׃"));
hebsuperobject.biblemap.put("b5_10_17", new hebsuperobject(5,10,17,"כי יהוה אלהיכם הוא אלהי האלהים ואדני האדנים האל הגדל הגבר והנורא אשר לא ישא פנים ולא יקח שחד׃"));
hebsuperobject.biblemap.put("b5_10_18", new hebsuperobject(5,10,18,"עשה משפט יתום ואלמנה ואהב גר לתת לו לחם ושמלה׃"));
hebsuperobject.biblemap.put("b5_10_19", new hebsuperobject(5,10,19,"ואהבתם את הגר כי גרים הייתם בארץ מצרים׃"));
hebsuperobject.biblemap.put("b5_10_20", new hebsuperobject(5,10,20,"את יהוה אלהיך תירא אתו תעבד ובו תדבק ובשמו תשבע׃"));
hebsuperobject.biblemap.put("b5_10_21", new hebsuperobject(5,10,21,"הוא תהלתך והוא אלהיך אשר עשה אתך את הגדלת ואת הנוראת האלה אשר ראו עיניך׃"));
hebsuperobject.biblemap.put("b5_10_22", new hebsuperobject(5,10,22,"בשבעים נפש ירדו אבתיך מצרימה ועתה שמך יהוה אלהיך ככוכבי השמים לרב׃"));
hebsuperobject.biblemap.put("b5_11_1", new hebsuperobject(5,11,1,"ואהבת את יהוה אלהיך ושמרת משמרתו וחקתיו ומשפטיו ומצותיו כל הימים׃"));
hebsuperobject.biblemap.put("b5_11_2", new hebsuperobject(5,11,2,"וידעתם היום כי לא את בניכם אשר לא ידעו ואשר לא ראו את מוסר יהוה אלהיכם את גדלו את ידו החזקה וזרעו הנטויה׃"));
hebsuperobject.biblemap.put("b5_11_3", new hebsuperobject(5,11,3,"ואת אתתיו ואת מעשיו אשר עשה בתוך מצרים לפרעה מלך מצרים ולכל ארצו׃"));
hebsuperobject.biblemap.put("b5_11_4", new hebsuperobject(5,11,4,"ואשר עשה לחיל מצרים לסוסיו ולרכבו אשר הציף את מי ים סוף על פניהם ברדפם אחריכם ויאבדם יהוה עד היום הזה׃"));
hebsuperobject.biblemap.put("b5_11_5", new hebsuperobject(5,11,5,"ואשר עשה לכם במדבר עד באכם עד המקום הזה׃"));
hebsuperobject.biblemap.put("b5_11_6", new hebsuperobject(5,11,6,"ואשר עשה לדתן ולאבירם בני אליאב בן ראובן אשר פצתה הארץ את פיה ותבלעם ואת בתיהם ואת אהליהם ואת כל היקום אשר ברגליהם בקרב כל ישראל׃"));
hebsuperobject.biblemap.put("b5_11_7", new hebsuperobject(5,11,7,"כי עיניכם הראת את כל מעשה יהוה הגדל אשר עשה׃"));
hebsuperobject.biblemap.put("b5_11_8", new hebsuperobject(5,11,8,"ושמרתם את כל המצוה אשר אנכי מצוך היום למען תחזקו ובאתם וירשתם את הארץ אשר אתם עברים שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_11_9", new hebsuperobject(5,11,9,"ולמען תאריכו ימים על האדמה אשר נשבע יהוה לאבתיכם לתת להם ולזרעם ארץ זבת חלב ודבש׃"));
hebsuperobject.biblemap.put("b5_11_10", new hebsuperobject(5,11,10,"כי הארץ אשר אתה בא שמה לרשתה לא כארץ מצרים הוא אשר יצאתם משם אשר תזרע את זרעך והשקית ברגלך כגן הירק׃"));
hebsuperobject.biblemap.put("b5_11_11", new hebsuperobject(5,11,11,"והארץ אשר אתם עברים שמה לרשתה ארץ הרים ובקעת למטר השמים תשתה מים׃"));
hebsuperobject.biblemap.put("b5_11_12", new hebsuperobject(5,11,12,"ארץ אשר יהוה אלהיך דרש אתה תמיד עיני יהוה אלהיך בה מרשית השנה ועד אחרית שנה׃"));
hebsuperobject.biblemap.put("b5_11_13", new hebsuperobject(5,11,13,"והיה אם שמע תשמעו אל מצותי אשר אנכי מצוה אתכם היום לאהבה את יהוה אלהיכם ולעבדו בכל לבבכם ובכל נפשכם׃"));
hebsuperobject.biblemap.put("b5_11_14", new hebsuperobject(5,11,14,"ונתתי מטר ארצכם בעתו יורה ומלקוש ואספת דגנך ותירשך ויצהרך׃"));
hebsuperobject.biblemap.put("b5_11_15", new hebsuperobject(5,11,15,"ונתתי עשב בשדך לבהמתך ואכלת ושבעת׃"));
hebsuperobject.biblemap.put("b5_11_16", new hebsuperobject(5,11,16,"השמרו לכם פן יפתה לבבכם וסרתם ועבדתם אלהים אחרים והשתחויתם להם׃"));
hebsuperobject.biblemap.put("b5_11_17", new hebsuperobject(5,11,17,"וחרה אף יהוה בכם ועצר את השמים ולא יהיה מטר והאדמה לא תתן את יבולה ואבדתם מהרה מעל הארץ הטבה אשר יהוה נתן לכם׃"));
hebsuperobject.biblemap.put("b5_11_18", new hebsuperobject(5,11,18,"ושמתם את דברי אלה על לבבכם ועל נפשכם וקשרתם אתם לאות על ידכם והיו לטוטפת בין עיניכם׃"));
hebsuperobject.biblemap.put("b5_11_19", new hebsuperobject(5,11,19,"ולמדתם אתם את בניכם לדבר בם בשבתך בביתך ובלכתך בדרך ובשכבך ובקומך׃"));
hebsuperobject.biblemap.put("b5_11_20", new hebsuperobject(5,11,20,"וכתבתם על מזוזות ביתך ובשעריך׃"));
hebsuperobject.biblemap.put("b5_11_21", new hebsuperobject(5,11,21,"למען ירבו ימיכם וימי בניכם על האדמה אשר נשבע יהוה לאבתיכם לתת להם כימי השמים על הארץ׃"));
hebsuperobject.biblemap.put("b5_11_22", new hebsuperobject(5,11,22,"כי אם שמר תשמרון את כל המצוה הזאת אשר אנכי מצוה אתכם לעשתה לאהבה את יהוה אלהיכם ללכת בכל דרכיו ולדבקה בו׃"));
hebsuperobject.biblemap.put("b5_11_23", new hebsuperobject(5,11,23,"והוריש יהוה את כל הגוים האלה מלפניכם וירשתם גוים גדלים ועצמים מכם׃"));
hebsuperobject.biblemap.put("b5_11_24", new hebsuperobject(5,11,24,"כל המקום אשר תדרך כף רגלכם בו לכם יהיה מן המדבר והלבנון מן הנהר נהר פרת ועד הים האחרון יהיה גבלכם׃"));
hebsuperobject.biblemap.put("b5_11_25", new hebsuperobject(5,11,25,"לא יתיצב איש בפניכם פחדכם ומוראכם יתן יהוה אלהיכם על פני כל הארץ אשר תדרכו בה כאשר דבר לכם׃"));
hebsuperobject.biblemap.put("b5_11_26", new hebsuperobject(5,11,26,"ראה אנכי נתן לפניכם היום ברכה וקללה׃"));
hebsuperobject.biblemap.put("b5_11_27", new hebsuperobject(5,11,27,"את הברכה אשר תשמעו אל מצות יהוה אלהיכם אשר אנכי מצוה אתכם היום׃"));
hebsuperobject.biblemap.put("b5_11_28", new hebsuperobject(5,11,28,"והקללה אם לא תשמעו אל מצות יהוה אלהיכם וסרתם מן הדרך אשר אנכי מצוה אתכם היום ללכת אחרי אלהים אחרים אשר לא ידעתם׃"));
hebsuperobject.biblemap.put("b5_11_29", new hebsuperobject(5,11,29,"והיה כי יביאך יהוה אלהיך אל הארץ אשר אתה בא שמה לרשתה ונתתה את הברכה על הר גרזים ואת הקללה על הר עיבל׃"));
hebsuperobject.biblemap.put("b5_11_30", new hebsuperobject(5,11,30,"הלא המה בעבר הירדן אחרי דרך מבוא השמש בארץ הכנעני הישב בערבה מול הגלגל אצל אלוני מרה׃"));
hebsuperobject.biblemap.put("b5_11_31", new hebsuperobject(5,11,31,"כי אתם עברים את הירדן לבא לרשת את הארץ אשר יהוה אלהיכם נתן לכם וירשתם אתה וישבתם בה׃"));
hebsuperobject.biblemap.put("b5_11_32", new hebsuperobject(5,11,32,"ושמרתם לעשות את כל החקים ואת המשפטים אשר אנכי נתן לפניכם היום׃"));
hebsuperobject.biblemap.put("b5_12_1", new hebsuperobject(5,12,1,"אלה החקים והמשפטים אשר תשמרון לעשות בארץ אשר נתן יהוה אלהי אבתיך לך לרשתה כל הימים אשר אתם חיים על האדמה׃"));
hebsuperobject.biblemap.put("b5_12_2", new hebsuperobject(5,12,2,"אבד תאבדון את כל המקמות אשר עבדו שם הגוים אשר אתם ירשים אתם את אלהיהם על ההרים הרמים ועל הגבעות ותחת כל עץ רענן׃"));
hebsuperobject.biblemap.put("b5_12_3", new hebsuperobject(5,12,3,"ונתצתם את מזבחתם ושברתם את מצבתם ואשריהם תשרפון באש ופסילי אלהיהם תגדעון ואבדתם את שמם מן המקום ההוא׃"));
hebsuperobject.biblemap.put("b5_12_4", new hebsuperobject(5,12,4,"לא תעשון כן ליהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b5_12_5", new hebsuperobject(5,12,5,"כי אם אל המקום אשר יבחר יהוה אלהיכם מכל שבטיכם לשום את שמו שם לשכנו תדרשו ובאת שמה׃"));
hebsuperobject.biblemap.put("b5_12_6", new hebsuperobject(5,12,6,"והבאתם שמה עלתיכם וזבחיכם ואת מעשרתיכם ואת תרומת ידכם ונדריכם ונדבתיכם ובכרת בקרכם וצאנכם׃"));
hebsuperobject.biblemap.put("b5_12_7", new hebsuperobject(5,12,7,"ואכלתם שם לפני יהוה אלהיכם ושמחתם בכל משלח ידכם אתם ובתיכם אשר ברכך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_12_8", new hebsuperobject(5,12,8,"לא תעשון ככל אשר אנחנו עשים פה היום איש כל הישר בעיניו׃"));
hebsuperobject.biblemap.put("b5_12_9", new hebsuperobject(5,12,9,"כי לא באתם עד עתה אל המנוחה ואל הנחלה אשר יהוה אלהיך נתן לך׃"));
hebsuperobject.biblemap.put("b5_12_10", new hebsuperobject(5,12,10,"ועברתם את הירדן וישבתם בארץ אשר יהוה אלהיכם מנחיל אתכם והניח לכם מכל איביכם מסביב וישבתם בטח׃"));
hebsuperobject.biblemap.put("b5_12_11", new hebsuperobject(5,12,11,"והיה המקום אשר יבחר יהוה אלהיכם בו לשכן שמו שם שמה תביאו את כל אשר אנכי מצוה אתכם עולתיכם וזבחיכם מעשרתיכם ותרמת ידכם וכל מבחר נדריכם אשר תדרו ליהוה׃"));
hebsuperobject.biblemap.put("b5_12_12", new hebsuperobject(5,12,12,"ושמחתם לפני יהוה אלהיכם אתם ובניכם ובנתיכם ועבדיכם ואמהתיכם והלוי אשר בשעריכם כי אין לו חלק ונחלה אתכם׃"));
hebsuperobject.biblemap.put("b5_12_13", new hebsuperobject(5,12,13,"השמר לך פן תעלה עלתיך בכל מקום אשר תראה׃"));
hebsuperobject.biblemap.put("b5_12_14", new hebsuperobject(5,12,14,"כי אם במקום אשר יבחר יהוה באחד שבטיך שם תעלה עלתיך ושם תעשה כל אשר אנכי מצוך׃"));
hebsuperobject.biblemap.put("b5_12_15", new hebsuperobject(5,12,15,"רק בכל אות נפשך תזבח ואכלת בשר כברכת יהוה אלהיך אשר נתן לך בכל שעריך הטמא והטהור יאכלנו כצבי וכאיל׃"));
hebsuperobject.biblemap.put("b5_12_16", new hebsuperobject(5,12,16,"רק הדם לא תאכלו על הארץ תשפכנו כמים׃"));
hebsuperobject.biblemap.put("b5_12_17", new hebsuperobject(5,12,17,"לא תוכל לאכל בשעריך מעשר דגנך ותירשך ויצהרך ובכרת בקרך וצאנך וכל נדריך אשר תדר ונדבתיך ותרומת ידך׃"));
hebsuperobject.biblemap.put("b5_12_18", new hebsuperobject(5,12,18,"כי אם לפני יהוה אלהיך תאכלנו במקום אשר יבחר יהוה אלהיך בו אתה ובנך ובתך ועבדך ואמתך והלוי אשר בשעריך ושמחת לפני יהוה אלהיך בכל משלח ידך׃"));
hebsuperobject.biblemap.put("b5_12_19", new hebsuperobject(5,12,19,"השמר לך פן תעזב את הלוי כל ימיך על אדמתך׃"));
hebsuperobject.biblemap.put("b5_12_20", new hebsuperobject(5,12,20,"כי ירחיב יהוה אלהיך את גבולך כאשר דבר לך ואמרת אכלה בשר כי תאוה נפשך לאכל בשר בכל אות נפשך תאכל בשר׃"));
hebsuperobject.biblemap.put("b5_12_21", new hebsuperobject(5,12,21,"כי ירחק ממך המקום אשר יבחר יהוה אלהיך לשום שמו שם וזבחת מבקרך ומצאנך אשר נתן יהוה לך כאשר צויתך ואכלת בשעריך בכל אות נפשך׃"));
hebsuperobject.biblemap.put("b5_12_22", new hebsuperobject(5,12,22,"אך כאשר יאכל את הצבי ואת האיל כן תאכלנו הטמא והטהור יחדו יאכלנו׃"));
hebsuperobject.biblemap.put("b5_12_23", new hebsuperobject(5,12,23,"רק חזק לבלתי אכל הדם כי הדם הוא הנפש ולא תאכל הנפש עם הבשר׃"));
hebsuperobject.biblemap.put("b5_12_24", new hebsuperobject(5,12,24,"לא תאכלנו על הארץ תשפכנו כמים׃"));
hebsuperobject.biblemap.put("b5_12_25", new hebsuperobject(5,12,25,"לא תאכלנו למען ייטב לך ולבניך אחריך כי תעשה הישר בעיני יהוה׃"));
hebsuperobject.biblemap.put("b5_12_26", new hebsuperobject(5,12,26,"רק קדשיך אשר יהיו לך ונדריך תשא ובאת אל המקום אשר יבחר יהוה׃"));
hebsuperobject.biblemap.put("b5_12_27", new hebsuperobject(5,12,27,"ועשית עלתיך הבשר והדם על מזבח יהוה אלהיך ודם זבחיך ישפך על מזבח יהוה אלהיך והבשר תאכל׃"));
hebsuperobject.biblemap.put("b5_12_28", new hebsuperobject(5,12,28,"שמר ושמעת את כל הדברים האלה אשר אנכי מצוך למען ייטב לך ולבניך אחריך עד עולם כי תעשה הטוב והישר בעיני יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_12_29", new hebsuperobject(5,12,29,"כי יכרית יהוה אלהיך את הגוים אשר אתה בא שמה לרשת אותם מפניך וירשת אתם וישבת בארצם׃"));
hebsuperobject.biblemap.put("b5_12_30", new hebsuperobject(5,12,30,"השמר לך פן תנקש אחריהם אחרי השמדם מפניך ופן תדרש לאלהיהם לאמר איכה יעבדו הגוים האלה את אלהיהם ואעשה כן גם אני׃"));
hebsuperobject.biblemap.put("b5_12_31", new hebsuperobject(5,12,31,"לא תעשה כן ליהוה אלהיך כי כל תועבת יהוה אשר שנא עשו לאלהיהם כי גם את בניהם ואת בנתיהם ישרפו באש לאלהיהם׃"));
hebsuperobject.biblemap.put("b5_12_32", new hebsuperobject(5,12,32,"את כל הדבר אשר אנכי מצוה אתכם אתו תשמרו לעשות לא תסף עליו ולא תגרע ממנו׃"));
hebsuperobject.biblemap.put("b5_13_1", new hebsuperobject(5,13,1,"כי יקום בקרבך נביא או חלם חלום ונתן אליך אות או מופת׃"));
hebsuperobject.biblemap.put("b5_13_2", new hebsuperobject(5,13,2,"ובא האות והמופת אשר דבר אליך לאמר נלכה אחרי אלהים אחרים אשר לא ידעתם ונעבדם׃"));
hebsuperobject.biblemap.put("b5_13_3", new hebsuperobject(5,13,3,"לא תשמע אל דברי הנביא ההוא או אל חולם החלום ההוא כי מנסה יהוה אלהיכם אתכם לדעת הישכם אהבים את יהוה אלהיכם בכל לבבכם ובכל נפשכם׃"));
hebsuperobject.biblemap.put("b5_13_4", new hebsuperobject(5,13,4,"אחרי יהוה אלהיכם תלכו ואתו תיראו ואת מצותיו תשמרו ובקלו תשמעו ואתו תעבדו ובו תדבקון׃"));
hebsuperobject.biblemap.put("b5_13_5", new hebsuperobject(5,13,5,"והנביא ההוא או חלם החלום ההוא יומת כי דבר סרה על יהוה אלהיכם המוציא אתכם מארץ מצרים והפדך מבית עבדים להדיחך מן הדרך אשר צוך יהוה אלהיך ללכת בה ובערת הרע מקרבך׃"));
hebsuperobject.biblemap.put("b5_13_6", new hebsuperobject(5,13,6,"כי יסיתך אחיך בן אמך או בנך או בתך או אשת חיקך או רעך אשר כנפשך בסתר לאמר נלכה ונעבדה אלהים אחרים אשר לא ידעת אתה ואבתיך׃"));
hebsuperobject.biblemap.put("b5_13_7", new hebsuperobject(5,13,7,"מאלהי העמים אשר סביבתיכם הקרבים אליך או הרחקים ממך מקצה הארץ ועד קצה הארץ׃"));
hebsuperobject.biblemap.put("b5_13_8", new hebsuperobject(5,13,8,"לא תאבה לו ולא תשמע אליו ולא תחוס עינך עליו ולא תחמל ולא תכסה עליו׃"));
hebsuperobject.biblemap.put("b5_13_9", new hebsuperobject(5,13,9,"כי הרג תהרגנו ידך תהיה בו בראשונה להמיתו ויד כל העם באחרנה׃"));
hebsuperobject.biblemap.put("b5_13_10", new hebsuperobject(5,13,10,"וסקלתו באבנים ומת כי בקש להדיחך מעל יהוה אלהיך המוציאך מארץ מצרים מבית עבדים׃"));
hebsuperobject.biblemap.put("b5_13_11", new hebsuperobject(5,13,11,"וכל ישראל ישמעו ויראון ולא יוספו לעשות כדבר הרע הזה בקרבך׃"));
hebsuperobject.biblemap.put("b5_13_12", new hebsuperobject(5,13,12,"כי תשמע באחת עריך אשר יהוה אלהיך נתן לך לשבת שם לאמר׃"));
hebsuperobject.biblemap.put("b5_13_13", new hebsuperobject(5,13,13,"יצאו אנשים בני בליעל מקרבך וידיחו את ישבי עירם לאמר נלכה ונעבדה אלהים אחרים אשר לא ידעתם׃"));
hebsuperobject.biblemap.put("b5_13_14", new hebsuperobject(5,13,14,"ודרשת וחקרת ושאלת היטב והנה אמת נכון הדבר נעשתה התועבה הזאת בקרבך׃"));
hebsuperobject.biblemap.put("b5_13_15", new hebsuperobject(5,13,15,"הכה תכה את ישבי העיר ההוא לפי חרב החרם אתה ואת כל אשר בה ואת בהמתה לפי חרב׃"));
hebsuperobject.biblemap.put("b5_13_16", new hebsuperobject(5,13,16,"ואת כל שללה תקבץ אל תוך רחבה ושרפת באש את העיר ואת כל שללה כליל ליהוה אלהיך והיתה תל עולם לא תבנה עוד׃"));
