hebsuperobject.biblemap.put("b5_14_8", new hebsuperobject(5,14,8,"ואת החזיר כי מפריס פרסה הוא ולא גרה טמא הוא לכם מבשרם לא תאכלו ובנבלתם לא תגעו׃"));
hebsuperobject.biblemap.put("b5_14_9", new hebsuperobject(5,14,9,"את זה תאכלו מכל אשר במים כל אשר לו סנפיר וקשקשת תאכלו׃"));
