hebsuperobject.biblemap.put("b5_16_11", new hebsuperobject(5,16,11,"ושמחת לפני יהוה אלהיך אתה ובנך ובתך ועבדך ואמתך והלוי אשר בשעריך והגר והיתום והאלמנה אשר בקרבך במקום אשר יבחר יהוה אלהיך לשכן שמו שם׃"));
