hebsuperobject.biblemap.put("b5_17_4", new hebsuperobject(5,17,4,"והגד לך ושמעת ודרשת היטב והנה אמת נכון הדבר נעשתה התועבה הזאת בישראל׃"));
hebsuperobject.biblemap.put("b5_17_5", new hebsuperobject(5,17,5,"והוצאת את האיש ההוא או את האשה ההוא אשר עשו את הדבר הרע הזה אל שעריך את האיש או את האשה וסקלתם באבנים ומתו׃"));
hebsuperobject.biblemap.put("b5_17_6", new hebsuperobject(5,17,6,"על פי שנים עדים או שלשה עדים יומת המת לא יומת על פי עד אחד׃"));
hebsuperobject.biblemap.put("b5_17_7", new hebsuperobject(5,17,7,"יד העדים תהיה בו בראשנה להמיתו ויד כל העם באחרנה ובערת הרע מקרבך׃"));
hebsuperobject.biblemap.put("b5_17_8", new hebsuperobject(5,17,8,"כי יפלא ממך דבר למשפט בין דם לדם בין דין לדין ובין נגע לנגע דברי ריבת בשעריך וקמת ועלית אל המקום אשר יבחר יהוה אלהיך בו׃"));
hebsuperobject.biblemap.put("b5_17_9", new hebsuperobject(5,17,9,"ובאת אל הכהנים הלוים ואל השפט אשר יהיה בימים ההם ודרשת והגידו לך את דבר המשפט׃"));
hebsuperobject.biblemap.put("b5_17_10", new hebsuperobject(5,17,10,"ועשית על פי הדבר אשר יגידו לך מן המקום ההוא אשר יבחר יהוה ושמרת לעשות ככל אשר יורוך׃"));
hebsuperobject.biblemap.put("b5_17_11", new hebsuperobject(5,17,11,"על פי התורה אשר יורוך ועל המשפט אשר יאמרו לך תעשה לא תסור מן הדבר אשר יגידו לך ימין ושמאל׃"));
hebsuperobject.biblemap.put("b5_17_12", new hebsuperobject(5,17,12,"והאיש אשר יעשה בזדון לבלתי שמע אל הכהן העמד לשרת שם את יהוה אלהיך או אל השפט ומת האיש ההוא ובערת הרע מישראל׃"));
hebsuperobject.biblemap.put("b5_17_13", new hebsuperobject(5,17,13,"וכל העם ישמעו ויראו ולא יזידון עוד׃"));
hebsuperobject.biblemap.put("b5_17_14", new hebsuperobject(5,17,14,"כי תבא אל הארץ אשר יהוה אלהיך נתן לך וירשתה וישבתה בה ואמרת אשימה עלי מלך ככל הגוים אשר סביבתי׃"));
hebsuperobject.biblemap.put("b5_17_15", new hebsuperobject(5,17,15,"שום תשים עליך מלך אשר יבחר יהוה אלהיך בו מקרב אחיך תשים עליך מלך לא תוכל לתת עליך איש נכרי אשר לא אחיך הוא׃"));
hebsuperobject.biblemap.put("b5_17_16", new hebsuperobject(5,17,16,"רק לא ירבה לו סוסים ולא ישיב את העם מצרימה למען הרבות סוס ויהוה אמר לכם לא תספון לשוב בדרך הזה עוד׃"));
hebsuperobject.biblemap.put("b5_17_17", new hebsuperobject(5,17,17,"ולא ירבה לו נשים ולא יסור לבבו וכסף וזהב לא ירבה לו מאד׃"));
hebsuperobject.biblemap.put("b5_17_18", new hebsuperobject(5,17,18,"והיה כשבתו על כסא ממלכתו וכתב לו את משנה התורה הזאת על ספר מלפני הכהנים הלוים׃"));
hebsuperobject.biblemap.put("b5_17_19", new hebsuperobject(5,17,19,"והיתה עמו וקרא בו כל ימי חייו למען ילמד ליראה את יהוה אלהיו לשמר את כל דברי התורה הזאת ואת החקים האלה לעשתם׃"));
hebsuperobject.biblemap.put("b5_17_20", new hebsuperobject(5,17,20,"לבלתי רום לבבו מאחיו ולבלתי סור מן המצוה ימין ושמאול למען יאריך ימים על ממלכתו הוא ובניו בקרב ישראל׃"));
hebsuperobject.biblemap.put("b5_18_1", new hebsuperobject(5,18,1,"לא יהיה לכהנים הלוים כל שבט לוי חלק ונחלה עם ישראל אשי יהוה ונחלתו יאכלון׃"));
hebsuperobject.biblemap.put("b5_18_2", new hebsuperobject(5,18,2,"ונחלה לא יהיה לו בקרב אחיו יהוה הוא נחלתו כאשר דבר לו׃"));
hebsuperobject.biblemap.put("b5_18_3", new hebsuperobject(5,18,3,"וזה יהיה משפט הכהנים מאת העם מאת זבחי הזבח אם שור אם שה ונתן לכהן הזרע והלחיים והקבה׃"));
hebsuperobject.biblemap.put("b5_18_4", new hebsuperobject(5,18,4,"ראשית דגנך תירשך ויצהרך וראשית גז צאנך תתן לו׃"));
hebsuperobject.biblemap.put("b5_18_5", new hebsuperobject(5,18,5,"כי בו בחר יהוה אלהיך מכל שבטיך לעמד לשרת בשם יהוה הוא ובניו כל הימים׃"));
hebsuperobject.biblemap.put("b5_18_6", new hebsuperobject(5,18,6,"וכי יבא הלוי מאחד שעריך מכל ישראל אשר הוא גר שם ובא בכל אות נפשו אל המקום אשר יבחר יהוה׃"));
hebsuperobject.biblemap.put("b5_18_7", new hebsuperobject(5,18,7,"ושרת בשם יהוה אלהיו ככל אחיו הלוים העמדים שם לפני יהוה׃"));
hebsuperobject.biblemap.put("b5_18_8", new hebsuperobject(5,18,8,"חלק כחלק יאכלו לבד ממכריו על האבות׃"));
hebsuperobject.biblemap.put("b5_18_9", new hebsuperobject(5,18,9,"כי אתה בא אל הארץ אשר יהוה אלהיך נתן לך לא תלמד לעשות כתועבת הגוים ההם׃"));
hebsuperobject.biblemap.put("b5_18_10", new hebsuperobject(5,18,10,"לא ימצא בך מעביר בנו ובתו באש קסם קסמים מעונן ומנחש ומכשף׃"));
hebsuperobject.biblemap.put("b5_18_11", new hebsuperobject(5,18,11,"וחבר חבר ושאל אוב וידעני ודרש אל המתים׃"));
hebsuperobject.biblemap.put("b5_18_12", new hebsuperobject(5,18,12,"כי תועבת יהוה כל עשה אלה ובגלל התועבת האלה יהוה אלהיך מוריש אותם מפניך׃"));
hebsuperobject.biblemap.put("b5_18_13", new hebsuperobject(5,18,13,"תמים תהיה עם יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_18_14", new hebsuperobject(5,18,14,"כי הגוים האלה אשר אתה יורש אותם אל מעננים ואל קסמים ישמעו ואתה לא כן נתן לך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_18_15", new hebsuperobject(5,18,15,"נביא מקרבך מאחיך כמני יקים לך יהוה אלהיך אליו תשמעון׃"));
hebsuperobject.biblemap.put("b5_18_16", new hebsuperobject(5,18,16,"ככל אשר שאלת מעם יהוה אלהיך בחרב ביום הקהל לאמר לא אסף לשמע את קול יהוה אלהי ואת האש הגדלה הזאת לא אראה עוד ולא אמות׃"));
hebsuperobject.biblemap.put("b5_18_17", new hebsuperobject(5,18,17,"ויאמר יהוה אלי היטיבו אשר דברו׃"));
hebsuperobject.biblemap.put("b5_18_18", new hebsuperobject(5,18,18,"נביא אקים להם מקרב אחיהם כמוך ונתתי דברי בפיו ודבר אליהם את כל אשר אצונו׃"));
hebsuperobject.biblemap.put("b5_18_19", new hebsuperobject(5,18,19,"והיה האיש אשר לא ישמע אל דברי אשר ידבר בשמי אנכי אדרש מעמו׃"));
hebsuperobject.biblemap.put("b5_18_20", new hebsuperobject(5,18,20,"אך הנביא אשר יזיד לדבר דבר בשמי את אשר לא צויתיו לדבר ואשר ידבר בשם אלהים אחרים ומת הנביא ההוא׃"));
hebsuperobject.biblemap.put("b5_18_21", new hebsuperobject(5,18,21,"וכי תאמר בלבבך איכה נדע את הדבר אשר לא דברו יהוה׃"));
hebsuperobject.biblemap.put("b5_18_22", new hebsuperobject(5,18,22,"אשר ידבר הנביא בשם יהוה ולא יהיה הדבר ולא יבוא הוא הדבר אשר לא דברו יהוה בזדון דברו הנביא לא תגור ממנו׃"));
hebsuperobject.biblemap.put("b5_19_1", new hebsuperobject(5,19,1,"כי יכרית יהוה אלהיך את הגוים אשר יהוה אלהיך נתן לך את ארצם וירשתם וישבת בעריהם ובבתיהם׃"));
hebsuperobject.biblemap.put("b5_19_2", new hebsuperobject(5,19,2,"שלוש ערים תבדיל לך בתוך ארצך אשר יהוה אלהיך נתן לך לרשתה׃"));
hebsuperobject.biblemap.put("b5_19_3", new hebsuperobject(5,19,3,"תכין לך הדרך ושלשת את גבול ארצך אשר ינחילך יהוה אלהיך והיה לנוס שמה כל רצח׃"));
hebsuperobject.biblemap.put("b5_19_4", new hebsuperobject(5,19,4,"וזה דבר הרצח אשר ינוס שמה וחי אשר יכה את רעהו בבלי דעת והוא לא שנא לו מתמל שלשם׃"));
hebsuperobject.biblemap.put("b5_19_5", new hebsuperobject(5,19,5,"ואשר יבא את רעהו ביער לחטב עצים ונדחה ידו בגרזן לכרת העץ ונשל הברזל מן העץ ומצא את רעהו ומת הוא ינוס אל אחת הערים האלה וחי׃"));
hebsuperobject.biblemap.put("b5_19_6", new hebsuperobject(5,19,6,"פן ירדף גאל הדם אחרי הרצח כי יחם לבבו והשיגו כי ירבה הדרך והכהו נפש ולו אין משפט מות כי לא שנא הוא לו מתמול שלשום׃"));
hebsuperobject.biblemap.put("b5_19_7", new hebsuperobject(5,19,7,"על כן אנכי מצוך לאמר שלש ערים תבדיל לך׃"));
hebsuperobject.biblemap.put("b5_19_8", new hebsuperobject(5,19,8,"ואם ירחיב יהוה אלהיך את גבלך כאשר נשבע לאבתיך ונתן לך את כל הארץ אשר דבר לתת לאבתיך׃"));
hebsuperobject.biblemap.put("b5_19_9", new hebsuperobject(5,19,9,"כי תשמר את כל המצוה הזאת לעשתה אשר אנכי מצוך היום לאהבה את יהוה אלהיך וללכת בדרכיו כל הימים ויספת לך עוד שלש ערים על השלש האלה׃"));
hebsuperobject.biblemap.put("b5_19_10", new hebsuperobject(5,19,10,"ולא ישפך דם נקי בקרב ארצך אשר יהוה אלהיך נתן לך נחלה והיה עליך דמים׃"));
hebsuperobject.biblemap.put("b5_19_11", new hebsuperobject(5,19,11,"וכי יהיה איש שנא לרעהו וארב לו וקם עליו והכהו נפש ומת ונס אל אחת הערים האל׃"));
hebsuperobject.biblemap.put("b5_19_12", new hebsuperobject(5,19,12,"ושלחו זקני עירו ולקחו אתו משם ונתנו אתו ביד גאל הדם ומת׃"));
hebsuperobject.biblemap.put("b5_19_13", new hebsuperobject(5,19,13,"לא תחוס עינך עליו ובערת דם הנקי מישראל וטוב לך׃"));
hebsuperobject.biblemap.put("b5_19_14", new hebsuperobject(5,19,14,"לא תסיג גבול רעך אשר גבלו ראשנים בנחלתך אשר תנחל בארץ אשר יהוה אלהיך נתן לך לרשתה׃"));
hebsuperobject.biblemap.put("b5_19_15", new hebsuperobject(5,19,15,"לא יקום עד אחד באיש לכל עון ולכל חטאת בכל חטא אשר יחטא על פי שני עדים או על פי שלשה עדים יקום דבר׃"));
hebsuperobject.biblemap.put("b5_19_16", new hebsuperobject(5,19,16,"כי יקום עד חמס באיש לענות בו סרה׃"));
hebsuperobject.biblemap.put("b5_19_17", new hebsuperobject(5,19,17,"ועמדו שני האנשים אשר להם הריב לפני יהוה לפני הכהנים והשפטים אשר יהיו בימים ההם׃"));
hebsuperobject.biblemap.put("b5_19_18", new hebsuperobject(5,19,18,"ודרשו השפטים היטב והנה עד שקר העד שקר ענה באחיו׃"));
hebsuperobject.biblemap.put("b5_19_19", new hebsuperobject(5,19,19,"ועשיתם לו כאשר זמם לעשות לאחיו ובערת הרע מקרבך׃"));
hebsuperobject.biblemap.put("b5_19_20", new hebsuperobject(5,19,20,"והנשארים ישמעו ויראו ולא יספו לעשות עוד כדבר הרע הזה בקרבך׃"));
hebsuperobject.biblemap.put("b5_19_21", new hebsuperobject(5,19,21,"ולא תחוס עינך נפש בנפש עין בעין שן בשן יד ביד רגל ברגל׃"));
hebsuperobject.biblemap.put("b5_20_1", new hebsuperobject(5,20,1,"כי תצא למלחמה על איביך וראית סוס ורכב עם רב ממך לא תירא מהם כי יהוה אלהיך עמך המעלך מארץ מצרים׃"));
hebsuperobject.biblemap.put("b5_20_2", new hebsuperobject(5,20,2,"והיה כקרבכם אל המלחמה ונגש הכהן ודבר אל העם׃"));
hebsuperobject.biblemap.put("b5_20_3", new hebsuperobject(5,20,3,"ואמר אלהם שמע ישראל אתם קרבים היום למלחמה על איביכם אל ירך לבבכם אל תיראו ואל תחפזו ואל תערצו מפניהם׃"));
hebsuperobject.biblemap.put("b5_20_4", new hebsuperobject(5,20,4,"כי יהוה אלהיכם ההלך עמכם להלחם לכם עם איביכם להושיע אתכם׃"));
hebsuperobject.biblemap.put("b5_20_5", new hebsuperobject(5,20,5,"ודברו השטרים אל העם לאמר מי האיש אשר בנה בית חדש ולא חנכו ילך וישב לביתו פן ימות במלחמה ואיש אחר יחנכנו׃"));
hebsuperobject.biblemap.put("b5_20_6", new hebsuperobject(5,20,6,"ומי האיש אשר נטע כרם ולא חללו ילך וישב לביתו פן ימות במלחמה ואיש אחר יחללנו׃"));
hebsuperobject.biblemap.put("b5_20_7", new hebsuperobject(5,20,7,"ומי האיש אשר ארש אשה ולא לקחה ילך וישב לביתו פן ימות במלחמה ואיש אחר יקחנה׃"));
hebsuperobject.biblemap.put("b5_20_8", new hebsuperobject(5,20,8,"ויספו השטרים לדבר אל העם ואמרו מי האיש הירא ורך הלבב ילך וישב לביתו ולא ימס את לבב אחיו כלבבו׃"));
hebsuperobject.biblemap.put("b5_20_9", new hebsuperobject(5,20,9,"והיה ככלת השטרים לדבר אל העם ופקדו שרי צבאות בראש העם׃"));
hebsuperobject.biblemap.put("b5_20_10", new hebsuperobject(5,20,10,"כי תקרב אל עיר להלחם עליה וקראת אליה לשלום׃"));
hebsuperobject.biblemap.put("b5_20_11", new hebsuperobject(5,20,11,"והיה אם שלום תענך ופתחה לך והיה כל העם הנמצא בה יהיו לך למס ועבדוך׃"));
hebsuperobject.biblemap.put("b5_20_12", new hebsuperobject(5,20,12,"ואם לא תשלים עמך ועשתה עמך מלחמה וצרת עליה׃"));
hebsuperobject.biblemap.put("b5_20_13", new hebsuperobject(5,20,13,"ונתנה יהוה אלהיך בידך והכית את כל זכורה לפי חרב׃"));
hebsuperobject.biblemap.put("b5_20_14", new hebsuperobject(5,20,14,"רק הנשים והטף והבהמה וכל אשר יהיה בעיר כל שללה תבז לך ואכלת את שלל איביך אשר נתן יהוה אלהיך לך׃"));
hebsuperobject.biblemap.put("b5_20_15", new hebsuperobject(5,20,15,"כן תעשה לכל הערים הרחקת ממך מאד אשר לא מערי הגוים האלה הנה׃"));
hebsuperobject.biblemap.put("b5_20_16", new hebsuperobject(5,20,16,"רק מערי העמים האלה אשר יהוה אלהיך נתן לך נחלה לא תחיה כל נשמה׃"));
hebsuperobject.biblemap.put("b5_20_17", new hebsuperobject(5,20,17,"כי החרם תחרימם החתי והאמרי הכנעני והפרזי החוי והיבוסי כאשר צוך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_20_18", new hebsuperobject(5,20,18,"למען אשר לא ילמדו אתכם לעשות ככל תועבתם אשר עשו לאלהיהם וחטאתם ליהוה אלהיכם׃"));
hebsuperobject.biblemap.put("b5_20_19", new hebsuperobject(5,20,19,"כי תצור אל עיר ימים רבים להלחם עליה לתפשה לא תשחית את עצה לנדח עליו גרזן כי ממנו תאכל ואתו לא תכרת כי האדם עץ השדה לבא מפניך במצור׃"));
hebsuperobject.biblemap.put("b5_20_20", new hebsuperobject(5,20,20,"רק עץ אשר תדע כי לא עץ מאכל הוא אתו תשחית וכרת ובנית מצור על העיר אשר הוא עשה עמך מלחמה עד רדתה׃"));
hebsuperobject.biblemap.put("b5_21_1", new hebsuperobject(5,21,1,"כי ימצא חלל באדמה אשר יהוה אלהיך נתן לך לרשתה נפל בשדה לא נודע מי הכהו׃"));
hebsuperobject.biblemap.put("b5_21_2", new hebsuperobject(5,21,2,"ויצאו זקניך ושפטיך ומדדו אל הערים אשר סביבת החלל׃"));
hebsuperobject.biblemap.put("b5_21_3", new hebsuperobject(5,21,3,"והיה העיר הקרבה אל החלל ולקחו זקני העיר ההוא עגלת בקר אשר לא עבד בה אשר לא משכה בעל׃"));
hebsuperobject.biblemap.put("b5_21_4", new hebsuperobject(5,21,4,"והורדו זקני העיר ההוא את העגלה אל נחל איתן אשר לא יעבד בו ולא יזרע וערפו שם את העגלה בנחל׃"));
hebsuperobject.biblemap.put("b5_21_5", new hebsuperobject(5,21,5,"ונגשו הכהנים בני לוי כי בם בחר יהוה אלהיך לשרתו ולברך בשם יהוה ועל פיהם יהיה כל ריב וכל נגע׃"));
hebsuperobject.biblemap.put("b5_21_6", new hebsuperobject(5,21,6,"וכל זקני העיר ההוא הקרבים אל החלל ירחצו את ידיהם על העגלה הערופה בנחל׃"));
hebsuperobject.biblemap.put("b5_21_7", new hebsuperobject(5,21,7,"וענו ואמרו ידינו לא שפכה את הדם הזה ועינינו לא ראו׃"));
hebsuperobject.biblemap.put("b5_21_8", new hebsuperobject(5,21,8,"כפר לעמך ישראל אשר פדית יהוה ואל תתן דם נקי בקרב עמך ישראל ונכפר להם הדם׃"));
hebsuperobject.biblemap.put("b5_21_9", new hebsuperobject(5,21,9,"ואתה תבער הדם הנקי מקרבך כי תעשה הישר בעיני יהוה׃"));
hebsuperobject.biblemap.put("b5_21_10", new hebsuperobject(5,21,10,"כי תצא למלחמה על איביך ונתנו יהוה אלהיך בידך ושבית שביו׃"));
hebsuperobject.biblemap.put("b5_21_11", new hebsuperobject(5,21,11,"וראית בשביה אשת יפת תאר וחשקת בה ולקחת לך לאשה׃"));
hebsuperobject.biblemap.put("b5_21_12", new hebsuperobject(5,21,12,"והבאתה אל תוך ביתך וגלחה את ראשה ועשתה את צפרניה׃"));
hebsuperobject.biblemap.put("b5_21_13", new hebsuperobject(5,21,13,"והסירה את שמלת שביה מעליה וישבה בביתך ובכתה את אביה ואת אמה ירח ימים ואחר כן תבוא אליה ובעלתה והיתה לך לאשה׃"));
hebsuperobject.biblemap.put("b5_21_14", new hebsuperobject(5,21,14,"והיה אם לא חפצת בה ושלחתה לנפשה ומכר לא תמכרנה בכסף לא תתעמר בה תחת אשר עניתה׃"));
hebsuperobject.biblemap.put("b5_21_15", new hebsuperobject(5,21,15,"כי תהיין לאיש שתי נשים האחת אהובה והאחת שנואה וילדו לו בנים האהובה והשנואה והיה הבן הבכור לשניאה׃"));
hebsuperobject.biblemap.put("b5_21_16", new hebsuperobject(5,21,16,"והיה ביום הנחילו את בניו את אשר יהיה לו לא יוכל לבכר את בן האהובה על פני בן השנואה הבכר׃"));
hebsuperobject.biblemap.put("b5_21_17", new hebsuperobject(5,21,17,"כי את הבכר בן השנואה יכיר לתת לו פי שנים בכל אשר ימצא לו כי הוא ראשית אנו לו משפט הבכרה׃"));
hebsuperobject.biblemap.put("b5_21_18", new hebsuperobject(5,21,18,"כי יהיה לאיש בן סורר ומורה איננו שמע בקול אביו ובקול אמו ויסרו אתו ולא ישמע אליהם׃"));
hebsuperobject.biblemap.put("b5_21_19", new hebsuperobject(5,21,19,"ותפשו בו אביו ואמו והוציאו אתו אל זקני עירו ואל שער מקמו׃"));
hebsuperobject.biblemap.put("b5_21_20", new hebsuperobject(5,21,20,"ואמרו אל זקני עירו בננו זה סורר ומרה איננו שמע בקלנו זולל וסבא׃"));
hebsuperobject.biblemap.put("b5_21_21", new hebsuperobject(5,21,21,"ורגמהו כל אנשי עירו באבנים ומת ובערת הרע מקרבך וכל ישראל ישמעו ויראו׃"));
hebsuperobject.biblemap.put("b5_21_22", new hebsuperobject(5,21,22,"וכי יהיה באיש חטא משפט מות והומת ותלית אתו על עץ׃"));
hebsuperobject.biblemap.put("b5_21_23", new hebsuperobject(5,21,23,"לא תלין נבלתו על העץ כי קבור תקברנו ביום ההוא כי קללת אלהים תלוי ולא תטמא את אדמתך אשר יהוה אלהיך נתן לך נחלה׃"));
hebsuperobject.biblemap.put("b5_22_1", new hebsuperobject(5,22,1,"לא תראה את שור אחיך או את שיו נדחים והתעלמת מהם השב תשיבם לאחיך׃"));
hebsuperobject.biblemap.put("b5_22_2", new hebsuperobject(5,22,2,"ואם לא קרוב אחיך אליך ולא ידעתו ואספתו אל תוך ביתך והיה עמך עד דרש אחיך אתו והשבתו לו׃"));
hebsuperobject.biblemap.put("b5_22_3", new hebsuperobject(5,22,3,"וכן תעשה לחמרו וכן תעשה לשמלתו וכן תעשה לכל אבדת אחיך אשר תאבד ממנו ומצאתה לא תוכל להתעלם׃"));
hebsuperobject.biblemap.put("b5_22_4", new hebsuperobject(5,22,4,"לא תראה את חמור אחיך או שורו נפלים בדרך והתעלמת מהם הקם תקים עמו׃"));
hebsuperobject.biblemap.put("b5_22_5", new hebsuperobject(5,22,5,"לא יהיה כלי גבר על אשה ולא ילבש גבר שמלת אשה כי תועבת יהוה אלהיך כל עשה אלה׃"));
hebsuperobject.biblemap.put("b5_22_6", new hebsuperobject(5,22,6,"כי יקרא קן צפור לפניך בדרך בכל עץ או על הארץ אפרחים או ביצים והאם רבצת על האפרחים או על הביצים לא תקח האם על הבנים׃"));
hebsuperobject.biblemap.put("b5_22_7", new hebsuperobject(5,22,7,"שלח תשלח את האם ואת הבנים תקח לך למען ייטב לך והארכת ימים׃"));
hebsuperobject.biblemap.put("b5_22_8", new hebsuperobject(5,22,8,"כי תבנה בית חדש ועשית מעקה לגגך ולא תשים דמים בביתך כי יפל הנפל ממנו׃"));
hebsuperobject.biblemap.put("b5_22_9", new hebsuperobject(5,22,9,"לא תזרע כרמך כלאים פן תקדש המלאה הזרע אשר תזרע ותבואת הכרם׃"));
hebsuperobject.biblemap.put("b5_22_10", new hebsuperobject(5,22,10,"לא תחרש בשור ובחמר יחדו׃"));
hebsuperobject.biblemap.put("b5_22_11", new hebsuperobject(5,22,11,"לא תלבש שעטנז צמר ופשתים יחדו׃"));
hebsuperobject.biblemap.put("b5_22_12", new hebsuperobject(5,22,12,"גדלים תעשה לך על ארבע כנפות כסותך אשר תכסה בה׃"));
hebsuperobject.biblemap.put("b5_22_13", new hebsuperobject(5,22,13,"כי יקח איש אשה ובא אליה ושנאה׃"));
hebsuperobject.biblemap.put("b5_22_14", new hebsuperobject(5,22,14,"ושם לה עלילת דברים והוציא עליה שם רע ואמר את האשה הזאת לקחתי ואקרב אליה ולא מצאתי לה בתולים׃"));
hebsuperobject.biblemap.put("b5_22_15", new hebsuperobject(5,22,15,"ולקח אבי הנער ואמה והוציאו את בתולי הנער אל זקני העיר השערה׃"));
hebsuperobject.biblemap.put("b5_22_16", new hebsuperobject(5,22,16,"ואמר אבי הנער אל הזקנים את בתי נתתי לאיש הזה לאשה וישנאה׃"));
hebsuperobject.biblemap.put("b5_22_17", new hebsuperobject(5,22,17,"והנה הוא שם עלילת דברים לאמר לא מצאתי לבתך בתולים ואלה בתולי בתי ופרשו השמלה לפני זקני העיר׃"));
hebsuperobject.biblemap.put("b5_22_18", new hebsuperobject(5,22,18,"ולקחו זקני העיר ההוא את האיש ויסרו אתו׃"));
hebsuperobject.biblemap.put("b5_22_19", new hebsuperobject(5,22,19,"וענשו אתו מאה כסף ונתנו לאבי הנערה כי הוציא שם רע על בתולת ישראל ולו תהיה לאשה לא יוכל לשלחה כל ימיו׃"));
hebsuperobject.biblemap.put("b5_22_20", new hebsuperobject(5,22,20,"ואם אמת היה הדבר הזה לא נמצאו בתולים לנער׃"));
hebsuperobject.biblemap.put("b5_22_21", new hebsuperobject(5,22,21,"והוציאו את הנער אל פתח בית אביה וסקלוה אנשי עירה באבנים ומתה כי עשתה נבלה בישראל לזנות בית אביה ובערת הרע מקרבך׃"));
hebsuperobject.biblemap.put("b5_22_22", new hebsuperobject(5,22,22,"כי ימצא איש שכב עם אשה בעלת בעל ומתו גם שניהם האיש השכב עם האשה והאשה ובערת הרע מישראל׃"));
hebsuperobject.biblemap.put("b5_22_23", new hebsuperobject(5,22,23,"כי יהיה נער בתולה מארשה לאיש ומצאה איש בעיר ושכב עמה׃"));
hebsuperobject.biblemap.put("b5_22_24", new hebsuperobject(5,22,24,"והוצאתם את שניהם אל שער העיר ההוא וסקלתם אתם באבנים ומתו את הנער על דבר אשר לא צעקה בעיר ואת האיש על דבר אשר ענה את אשת רעהו ובערת הרע מקרבך׃"));
hebsuperobject.biblemap.put("b5_22_25", new hebsuperobject(5,22,25,"ואם בשדה ימצא האיש את הנער המארשה והחזיק בה האיש ושכב עמה ומת האיש אשר שכב עמה לבדו׃"));
hebsuperobject.biblemap.put("b5_22_26", new hebsuperobject(5,22,26,"ולנער לא תעשה דבר אין לנער חטא מות כי כאשר יקום איש על רעהו ורצחו נפש כן הדבר הזה׃"));
hebsuperobject.biblemap.put("b5_22_27", new hebsuperobject(5,22,27,"כי בשדה מצאה צעקה הנער המארשה ואין מושיע לה׃"));
hebsuperobject.biblemap.put("b5_22_28", new hebsuperobject(5,22,28,"כי ימצא איש נער בתולה אשר לא ארשה ותפשה ושכב עמה ונמצאו׃"));
hebsuperobject.biblemap.put("b5_22_29", new hebsuperobject(5,22,29,"ונתן האיש השכב עמה לאבי הנער חמשים כסף ולו תהיה לאשה תחת אשר ענה לא יוכל שלחה כל ימיו׃"));
hebsuperobject.biblemap.put("b5_22_30", new hebsuperobject(5,22,30,"לא יקח איש את אשת אביו ולא יגלה כנף אביו׃"));
hebsuperobject.biblemap.put("b5_23_1", new hebsuperobject(5,23,1,"לא יבא פצוע דכא וכרות שפכה בקהל יהוה׃"));
hebsuperobject.biblemap.put("b5_23_2", new hebsuperobject(5,23,2,"לא יבא ממזר בקהל יהוה גם דור עשירי לא יבא לו בקהל יהוה׃"));
hebsuperobject.biblemap.put("b5_23_3", new hebsuperobject(5,23,3,"לא יבא עמוני ומואבי בקהל יהוה גם דור עשירי לא יבא להם בקהל יהוה עד עולם׃"));
hebsuperobject.biblemap.put("b5_23_4", new hebsuperobject(5,23,4,"על דבר אשר לא קדמו אתכם בלחם ובמים בדרך בצאתכם ממצרים ואשר שכר עליך את בלעם בן בעור מפתור ארם נהרים לקללך׃"));
hebsuperobject.biblemap.put("b5_23_5", new hebsuperobject(5,23,5,"ולא אבה יהוה אלהיך לשמע אל בלעם ויהפך יהוה אלהיך לך את הקללה לברכה כי אהבך יהוה אלהיך׃"));
hebsuperobject.biblemap.put("b5_23_6", new hebsuperobject(5,23,6,"לא תדרש שלמם וטבתם כל ימיך לעולם׃"));
hebsuperobject.biblemap.put("b5_23_7", new hebsuperobject(5,23,7,"לא תתעב אדמי כי אחיך הוא לא תתעב מצרי כי גר היית בארצו׃"));
hebsuperobject.biblemap.put("b5_23_8", new hebsuperobject(5,23,8,"בנים אשר יולדו להם דור שלישי יבא להם בקהל יהוה׃"));
hebsuperobject.biblemap.put("b5_23_9", new hebsuperobject(5,23,9,"כי תצא מחנה על איביך ונשמרת מכל דבר רע׃"));
hebsuperobject.biblemap.put("b5_23_10", new hebsuperobject(5,23,10,"כי יהיה בך איש אשר לא יהיה טהור מקרה לילה ויצא אל מחוץ למחנה לא יבא אל תוך המחנה׃"));
hebsuperobject.biblemap.put("b5_23_11", new hebsuperobject(5,23,11,"והיה לפנות ערב ירחץ במים וכבא השמש יבא אל תוך המחנה׃"));
hebsuperobject.biblemap.put("b5_23_12", new hebsuperobject(5,23,12,"ויד תהיה לך מחוץ למחנה ויצאת שמה חוץ׃"));
hebsuperobject.biblemap.put("b5_23_13", new hebsuperobject(5,23,13,"ויתד תהיה לך על אזנך והיה בשבתך חוץ וחפרתה בה ושבת וכסית את צאתך׃"));
hebsuperobject.biblemap.put("b5_23_14", new hebsuperobject(5,23,14,"כי יהוה אלהיך מתהלך בקרב מחנך להצילך ולתת איביך לפניך והיה מחניך קדוש ולא יראה בך ערות דבר ושב מאחריך׃"));
hebsuperobject.biblemap.put("b5_23_15", new hebsuperobject(5,23,15,"לא תסגיר עבד אל אדניו אשר ינצל אליך מעם אדניו׃"));
hebsuperobject.biblemap.put("b5_23_16", new hebsuperobject(5,23,16,"עמך ישב בקרבך במקום אשר יבחר באחד שעריך בטוב לו לא תוננו׃"));
hebsuperobject.biblemap.put("b5_23_17", new hebsuperobject(5,23,17,"לא תהיה קדשה מבנות ישראל ולא יהיה קדש מבני ישראל׃"));
hebsuperobject.biblemap.put("b5_23_18", new hebsuperobject(5,23,18,"לא תביא אתנן זונה ומחיר כלב בית יהוה אלהיך לכל נדר כי תועבת יהוה אלהיך גם שניהם׃"));
hebsuperobject.biblemap.put("b5_23_19", new hebsuperobject(5,23,19,"לא תשיך לאחיך נשך כסף נשך אכל נשך כל דבר אשר ישך׃"));
hebsuperobject.biblemap.put("b5_23_20", new hebsuperobject(5,23,20,"לנכרי תשיך ולאחיך לא תשיך למען יברכך יהוה אלהיך בכל משלח ידך על הארץ אשר אתה בא שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_23_21", new hebsuperobject(5,23,21,"כי תדר נדר ליהוה אלהיך לא תאחר לשלמו כי דרש ידרשנו יהוה אלהיך מעמך והיה בך חטא׃"));
hebsuperobject.biblemap.put("b5_23_22", new hebsuperobject(5,23,22,"וכי תחדל לנדר לא יהיה בך חטא׃"));
hebsuperobject.biblemap.put("b5_23_23", new hebsuperobject(5,23,23,"מוצא שפתיך תשמר ועשית כאשר נדרת ליהוה אלהיך נדבה אשר דברת בפיך׃"));
hebsuperobject.biblemap.put("b5_23_24", new hebsuperobject(5,23,24,"כי תבא בכרם רעך ואכלת ענבים כנפשך שבעך ואל כליך לא תתן׃"));
hebsuperobject.biblemap.put("b5_23_25", new hebsuperobject(5,23,25,"כי תבא בקמת רעך וקטפת מלילת בידך וחרמש לא תניף על קמת רעך׃"));
hebsuperobject.biblemap.put("b5_24_1", new hebsuperobject(5,24,1,"כי יקח איש אשה ובעלה והיה אם לא תמצא חן בעיניו כי מצא בה ערות דבר וכתב לה ספר כריתת ונתן בידה ושלחה מביתו׃"));
hebsuperobject.biblemap.put("b5_24_2", new hebsuperobject(5,24,2,"ויצאה מביתו והלכה והיתה לאיש אחר׃"));
hebsuperobject.biblemap.put("b5_24_3", new hebsuperobject(5,24,3,"ושנאה האיש האחרון וכתב לה ספר כריתת ונתן בידה ושלחה מביתו או כי ימות האיש האחרון אשר לקחה לו לאשה׃"));
hebsuperobject.biblemap.put("b5_24_4", new hebsuperobject(5,24,4,"לא יוכל בעלה הראשון אשר שלחה לשוב לקחתה להיות לו לאשה אחרי אשר הטמאה כי תועבה הוא לפני יהוה ולא תחטיא את הארץ אשר יהוה אלהיך נתן לך נחלה׃"));
hebsuperobject.biblemap.put("b5_24_5", new hebsuperobject(5,24,5,"כי יקח איש אשה חדשה לא יצא בצבא ולא יעבר עליו לכל דבר נקי יהיה לביתו שנה אחת ושמח את אשתו אשר לקח׃"));
hebsuperobject.biblemap.put("b5_24_6", new hebsuperobject(5,24,6,"לא יחבל רחים ורכב כי נפש הוא חבל׃"));
hebsuperobject.biblemap.put("b5_24_7", new hebsuperobject(5,24,7,"כי ימצא איש גנב נפש מאחיו מבני ישראל והתעמר בו ומכרו ומת הגנב ההוא ובערת הרע מקרבך׃"));
