hebsuperobject.biblemap.put("b5_29_18", new hebsuperobject(5,29,18,"פן יש בכם איש או אשה או משפחה או שבט אשר לבבו פנה היום מעם יהוה אלהינו ללכת לעבד את אלהי הגוים ההם פן יש בכם שרש פרה ראש ולענה׃"));
hebsuperobject.biblemap.put("b5_29_19", new hebsuperobject(5,29,19,"והיה בשמעו את דברי האלה הזאת והתברך בלבבו לאמר שלום יהיה לי כי בשררות לבי אלך למען ספות הרוה את הצמאה׃"));
hebsuperobject.biblemap.put("b5_29_20", new hebsuperobject(5,29,20,"לא יאבה יהוה סלח לו כי אז יעשן אף יהוה וקנאתו באיש ההוא ורבצה בו כל האלה הכתובה בספר הזה ומחה יהוה את שמו מתחת השמים׃"));
hebsuperobject.biblemap.put("b5_29_21", new hebsuperobject(5,29,21,"והבדילו יהוה לרעה מכל שבטי ישראל ככל אלות הברית הכתובה בספר התורה הזה׃"));
hebsuperobject.biblemap.put("b5_29_22", new hebsuperobject(5,29,22,"ואמר הדור האחרון בניכם אשר יקומו מאחריכם והנכרי אשר יבא מארץ רחוקה וראו את מכות הארץ ההוא ואת תחלאיה אשר חלה יהוה בה׃"));
hebsuperobject.biblemap.put("b5_29_23", new hebsuperobject(5,29,23,"גפרית ומלח שרפה כל ארצה לא תזרע ולא תצמח ולא יעלה בה כל עשב כמהפכת סדם ועמרה אדמה וצביים אשר הפך יהוה באפו ובחמתו׃"));
hebsuperobject.biblemap.put("b5_29_24", new hebsuperobject(5,29,24,"ואמרו כל הגוים על מה עשה יהוה ככה לארץ הזאת מה חרי האף הגדול הזה׃"));
hebsuperobject.biblemap.put("b5_29_25", new hebsuperobject(5,29,25,"ואמרו על אשר עזבו את ברית יהוה אלהי אבתם אשר כרת עמם בהוציאו אתם מארץ מצרים׃"));
hebsuperobject.biblemap.put("b5_29_26", new hebsuperobject(5,29,26,"וילכו ויעבדו אלהים אחרים וישתחוו להם אלהים אשר לא ידעום ולא חלק להם׃"));
hebsuperobject.biblemap.put("b5_29_27", new hebsuperobject(5,29,27,"ויחר אף יהוה בארץ ההוא להביא עליה את כל הקללה הכתובה בספר הזה׃"));
hebsuperobject.biblemap.put("b5_29_28", new hebsuperobject(5,29,28,"ויתשם יהוה מעל אדמתם באף ובחמה ובקצף גדול וישלכם אל ארץ אחרת כיום הזה׃"));
hebsuperobject.biblemap.put("b5_29_29", new hebsuperobject(5,29,29,"הנסתרת ליהוה אלהינו והנגלת לנו ולבנינו עד עולם לעשות את כל דברי התורה הזאת׃"));
hebsuperobject.biblemap.put("b5_30_1", new hebsuperobject(5,30,1,"והיה כי יבאו עליך כל הדברים האלה הברכה והקללה אשר נתתי לפניך והשבת אל לבבך בכל הגוים אשר הדיחך יהוה אלהיך שמה׃"));
hebsuperobject.biblemap.put("b5_30_2", new hebsuperobject(5,30,2,"ושבת עד יהוה אלהיך ושמעת בקלו ככל אשר אנכי מצוך היום אתה ובניך בכל לבבך ובכל נפשך׃"));
hebsuperobject.biblemap.put("b5_30_3", new hebsuperobject(5,30,3,"ושב יהוה אלהיך את שבותך ורחמך ושב וקבצך מכל העמים אשר הפיצך יהוה אלהיך שמה׃"));
hebsuperobject.biblemap.put("b5_30_4", new hebsuperobject(5,30,4,"אם יהיה נדחך בקצה השמים משם יקבצך יהוה אלהיך ומשם יקחך׃"));
hebsuperobject.biblemap.put("b5_30_5", new hebsuperobject(5,30,5,"והביאך יהוה אלהיך אל הארץ אשר ירשו אבתיך וירשתה והיטבך והרבך מאבתיך׃"));
hebsuperobject.biblemap.put("b5_30_6", new hebsuperobject(5,30,6,"ומל יהוה אלהיך את לבבך ואת לבב זרעך לאהבה את יהוה אלהיך בכל לבבך ובכל נפשך למען חייך׃"));
hebsuperobject.biblemap.put("b5_30_7", new hebsuperobject(5,30,7,"ונתן יהוה אלהיך את כל האלות האלה על איביך ועל שנאיך אשר רדפוך׃"));
hebsuperobject.biblemap.put("b5_30_8", new hebsuperobject(5,30,8,"ואתה תשוב ושמעת בקול יהוה ועשית את כל מצותיו אשר אנכי מצוך היום׃"));
hebsuperobject.biblemap.put("b5_30_9", new hebsuperobject(5,30,9,"והותירך יהוה אלהיך בכל מעשה ידך בפרי בטנך ובפרי בהמתך ובפרי אדמתך לטובה כי ישוב יהוה לשוש עליך לטוב כאשר שש על אבתיך׃"));
hebsuperobject.biblemap.put("b5_30_10", new hebsuperobject(5,30,10,"כי תשמע בקול יהוה אלהיך לשמר מצותיו וחקתיו הכתובה בספר התורה הזה כי תשוב אל יהוה אלהיך בכל לבבך ובכל נפשך׃"));
hebsuperobject.biblemap.put("b5_30_11", new hebsuperobject(5,30,11,"כי המצוה הזאת אשר אנכי מצוך היום לא נפלאת הוא ממך ולא רחקה הוא׃"));
hebsuperobject.biblemap.put("b5_30_12", new hebsuperobject(5,30,12,"לא בשמים הוא לאמר מי יעלה לנו השמימה ויקחה לנו וישמענו אתה ונעשנה׃"));
hebsuperobject.biblemap.put("b5_30_13", new hebsuperobject(5,30,13,"ולא מעבר לים הוא לאמר מי יעבר לנו אל עבר הים ויקחה לנו וישמענו אתה ונעשנה׃"));
hebsuperobject.biblemap.put("b5_30_14", new hebsuperobject(5,30,14,"כי קרוב אליך הדבר מאד בפיך ובלבבך לעשתו׃"));
hebsuperobject.biblemap.put("b5_30_15", new hebsuperobject(5,30,15,"ראה נתתי לפניך היום את החיים ואת הטוב ואת המות ואת הרע׃"));
hebsuperobject.biblemap.put("b5_30_16", new hebsuperobject(5,30,16,"אשר אנכי מצוך היום לאהבה את יהוה אלהיך ללכת בדרכיו ולשמר מצותיו וחקתיו ומשפטיו וחיית ורבית וברכך יהוה אלהיך בארץ אשר אתה בא שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_30_17", new hebsuperobject(5,30,17,"ואם יפנה לבבך ולא תשמע ונדחת והשתחוית לאלהים אחרים ועבדתם׃"));
hebsuperobject.biblemap.put("b5_30_18", new hebsuperobject(5,30,18,"הגדתי לכם היום כי אבד תאבדון לא תאריכן ימים על האדמה אשר אתה עבר את הירדן לבא שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_30_19", new hebsuperobject(5,30,19,"העידתי בכם היום את השמים ואת הארץ החיים והמות נתתי לפניך הברכה והקללה ובחרת בחיים למען תחיה אתה וזרעך׃"));
hebsuperobject.biblemap.put("b5_30_20", new hebsuperobject(5,30,20,"לאהבה את יהוה אלהיך לשמע בקלו ולדבקה בו כי הוא חייך וארך ימיך לשבת על האדמה אשר נשבע יהוה לאבתיך לאברהם ליצחק וליעקב לתת להם׃"));
hebsuperobject.biblemap.put("b5_31_1", new hebsuperobject(5,31,1,"וילך משה וידבר את הדברים האלה אל כל ישראל׃"));
hebsuperobject.biblemap.put("b5_31_2", new hebsuperobject(5,31,2,"ויאמר אלהם בן מאה ועשרים שנה אנכי היום לא אוכל עוד לצאת ולבוא ויהוה אמר אלי לא תעבר את הירדן הזה׃"));
hebsuperobject.biblemap.put("b5_31_3", new hebsuperobject(5,31,3,"יהוה אלהיך הוא עבר לפניך הוא ישמיד את הגוים האלה מלפניך וירשתם יהושע הוא עבר לפניך כאשר דבר יהוה׃"));
hebsuperobject.biblemap.put("b5_31_4", new hebsuperobject(5,31,4,"ועשה יהוה להם כאשר עשה לסיחון ולעוג מלכי האמרי ולארצם אשר השמיד אתם׃"));
hebsuperobject.biblemap.put("b5_31_5", new hebsuperobject(5,31,5,"ונתנם יהוה לפניכם ועשיתם להם ככל המצוה אשר צויתי אתכם׃"));
hebsuperobject.biblemap.put("b5_31_6", new hebsuperobject(5,31,6,"חזקו ואמצו אל תיראו ואל תערצו מפניהם כי יהוה אלהיך הוא ההלך עמך לא ירפך ולא יעזבך׃"));
hebsuperobject.biblemap.put("b5_31_7", new hebsuperobject(5,31,7,"ויקרא משה ליהושע ויאמר אליו לעיני כל ישראל חזק ואמץ כי אתה תבוא את העם הזה אל הארץ אשר נשבע יהוה לאבתם לתת להם ואתה תנחילנה אותם׃"));
hebsuperobject.biblemap.put("b5_31_8", new hebsuperobject(5,31,8,"ויהוה הוא ההלך לפניך הוא יהיה עמך לא ירפך ולא יעזבך לא תירא ולא תחת׃"));
hebsuperobject.biblemap.put("b5_31_9", new hebsuperobject(5,31,9,"ויכתב משה את התורה הזאת ויתנה אל הכהנים בני לוי הנשאים את ארון ברית יהוה ואל כל זקני ישראל׃"));
hebsuperobject.biblemap.put("b5_31_10", new hebsuperobject(5,31,10,"ויצו משה אותם לאמר מקץ שבע שנים במעד שנת השמטה בחג הסכות׃"));
hebsuperobject.biblemap.put("b5_31_11", new hebsuperobject(5,31,11,"בבוא כל ישראל לראות את פני יהוה אלהיך במקום אשר יבחר תקרא את התורה הזאת נגד כל ישראל באזניהם׃"));
hebsuperobject.biblemap.put("b5_31_12", new hebsuperobject(5,31,12,"הקהל את העם האנשים והנשים והטף וגרך אשר בשעריך למען ישמעו ולמען ילמדו ויראו את יהוה אלהיכם ושמרו לעשות את כל דברי התורה הזאת׃"));
hebsuperobject.biblemap.put("b5_31_13", new hebsuperobject(5,31,13,"ובניהם אשר לא ידעו ישמעו ולמדו ליראה את יהוה אלהיכם כל הימים אשר אתם חיים על האדמה אשר אתם עברים את הירדן שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_31_14", new hebsuperobject(5,31,14,"ויאמר יהוה אל משה הן קרבו ימיך למות קרא את יהושע והתיצבו באהל מועד ואצונו וילך משה ויהושע ויתיצבו באהל מועד׃"));
hebsuperobject.biblemap.put("b5_31_15", new hebsuperobject(5,31,15,"וירא יהוה באהל בעמוד ענן ויעמד עמוד הענן על פתח האהל׃"));
hebsuperobject.biblemap.put("b5_31_16", new hebsuperobject(5,31,16,"ויאמר יהוה אל משה הנך שכב עם אבתיך וקם העם הזה וזנה אחרי אלהי נכר הארץ אשר הוא בא שמה בקרבו ועזבני והפר את בריתי אשר כרתי אתו׃"));
hebsuperobject.biblemap.put("b5_31_17", new hebsuperobject(5,31,17,"וחרה אפי בו ביום ההוא ועזבתים והסתרתי פני מהם והיה לאכל ומצאהו רעות רבות וצרות ואמר ביום ההוא הלא על כי אין אלהי בקרבי מצאוני הרעות האלה׃"));
hebsuperobject.biblemap.put("b5_31_18", new hebsuperobject(5,31,18,"ואנכי הסתר אסתיר פני ביום ההוא על כל הרעה אשר עשה כי פנה אל אלהים אחרים׃"));
hebsuperobject.biblemap.put("b5_31_19", new hebsuperobject(5,31,19,"ועתה כתבו לכם את השירה הזאת ולמדה את בני ישראל שימה בפיהם למען תהיה לי השירה הזאת לעד בבני ישראל׃"));
hebsuperobject.biblemap.put("b5_31_20", new hebsuperobject(5,31,20,"כי אביאנו אל האדמה אשר נשבעתי לאבתיו זבת חלב ודבש ואכל ושבע ודשן ופנה אל אלהים אחרים ועבדום ונאצוני והפר את בריתי׃"));
hebsuperobject.biblemap.put("b5_31_21", new hebsuperobject(5,31,21,"והיה כי תמצאן אתו רעות רבות וצרות וענתה השירה הזאת לפניו לעד כי לא תשכח מפי זרעו כי ידעתי את יצרו אשר הוא עשה היום בטרם אביאנו אל הארץ אשר נשבעתי׃"));
hebsuperobject.biblemap.put("b5_31_22", new hebsuperobject(5,31,22,"ויכתב משה את השירה הזאת ביום ההוא וילמדה את בני ישראל׃"));
hebsuperobject.biblemap.put("b5_31_23", new hebsuperobject(5,31,23,"ויצו את יהושע בן נון ויאמר חזק ואמץ כי אתה תביא את בני ישראל אל הארץ אשר נשבעתי להם ואנכי אהיה עמך׃"));
hebsuperobject.biblemap.put("b5_31_24", new hebsuperobject(5,31,24,"ויהי ככלות משה לכתב את דברי התורה הזאת על ספר עד תמם׃"));
hebsuperobject.biblemap.put("b5_31_25", new hebsuperobject(5,31,25,"ויצו משה את הלוים נשאי ארון ברית יהוה לאמר׃"));
hebsuperobject.biblemap.put("b5_31_26", new hebsuperobject(5,31,26,"לקח את ספר התורה הזה ושמתם אתו מצד ארון ברית יהוה אלהיכם והיה שם בך לעד׃"));
hebsuperobject.biblemap.put("b5_31_27", new hebsuperobject(5,31,27,"כי אנכי ידעתי את מריך ואת ערפך הקשה הן בעודני חי עמכם היום ממרים היתם עם יהוה ואף כי אחרי מותי׃"));
hebsuperobject.biblemap.put("b5_31_28", new hebsuperobject(5,31,28,"הקהילו אלי את כל זקני שבטיכם ושטריכם ואדברה באזניהם את הדברים האלה ואעידה בם את השמים ואת הארץ׃"));
hebsuperobject.biblemap.put("b5_31_29", new hebsuperobject(5,31,29,"כי ידעתי אחרי מותי כי השחת תשחתון וסרתם מן הדרך אשר צויתי אתכם וקראת אתכם הרעה באחרית הימים כי תעשו את הרע בעיני יהוה להכעיסו במעשה ידיכם׃"));
hebsuperobject.biblemap.put("b5_31_30", new hebsuperobject(5,31,30,"וידבר משה באזני כל קהל ישראל את דברי השירה הזאת עד תמם׃"));
hebsuperobject.biblemap.put("b5_32_1", new hebsuperobject(5,32,1,"האזינו השמים ואדברה ותשמע הארץ אמרי פי׃"));
hebsuperobject.biblemap.put("b5_32_2", new hebsuperobject(5,32,2,"יערף כמטר לקחי תזל כטל אמרתי כשעירם עלי דשא וכרביבים עלי עשב׃"));
hebsuperobject.biblemap.put("b5_32_3", new hebsuperobject(5,32,3,"כי שם יהוה אקרא הבו גדל לאלהינו׃"));
hebsuperobject.biblemap.put("b5_32_4", new hebsuperobject(5,32,4,"הצור תמים פעלו כי כל דרכיו משפט אל אמונה ואין עול צדיק וישר הוא׃"));
hebsuperobject.biblemap.put("b5_32_5", new hebsuperobject(5,32,5,"שחת לו לא בניו מומם דור עקש ופתלתל׃"));
hebsuperobject.biblemap.put("b5_32_6", new hebsuperobject(5,32,6,"ה ליהוה תגמלו זאת עם נבל ולא חכם הלוא הוא אביך קנך הוא עשך ויכננך׃"));
hebsuperobject.biblemap.put("b5_32_7", new hebsuperobject(5,32,7,"זכר ימות עולם בינו שנות דור ודור שאל אביך ויגדך זקניך ויאמרו לך׃"));
hebsuperobject.biblemap.put("b5_32_8", new hebsuperobject(5,32,8,"בהנחל עליון גוים בהפרידו בני אדם יצב גבלת עמים למספר בני ישראל׃"));
hebsuperobject.biblemap.put("b5_32_9", new hebsuperobject(5,32,9,"כי חלק יהוה עמו יעקב חבל נחלתו׃"));
hebsuperobject.biblemap.put("b5_32_10", new hebsuperobject(5,32,10,"ימצאהו בארץ מדבר ובתהו ילל ישמן יסבבנהו יבוננהו יצרנהו כאישון עינו׃"));
hebsuperobject.biblemap.put("b5_32_11", new hebsuperobject(5,32,11,"כנשר יעיר קנו על גוזליו ירחף יפרש כנפיו יקחהו ישאהו על אברתו׃"));
hebsuperobject.biblemap.put("b5_32_12", new hebsuperobject(5,32,12,"יהוה בדד ינחנו ואין עמו אל נכר׃"));
hebsuperobject.biblemap.put("b5_32_13", new hebsuperobject(5,32,13,"ירכבהו על במותי ארץ ויאכל תנובת שדי וינקהו דבש מסלע ושמן מחלמיש צור׃"));
hebsuperobject.biblemap.put("b5_32_14", new hebsuperobject(5,32,14,"חמאת בקר וחלב צאן עם חלב כרים ואילים בני בשן ועתודים עם חלב כליות חטה ודם ענב תשתה חמר׃"));
hebsuperobject.biblemap.put("b5_32_15", new hebsuperobject(5,32,15,"וישמן ישרון ויבעט שמנת עבית כשית ויטש אלוה עשהו וינבל צור ישעתו׃"));
hebsuperobject.biblemap.put("b5_32_16", new hebsuperobject(5,32,16,"יקנאהו בזרים בתועבת יכעיסהו׃"));
hebsuperobject.biblemap.put("b5_32_17", new hebsuperobject(5,32,17,"יזבחו לשדים לא אלה אלהים לא ידעום חדשים מקרב באו לא שערום אבתיכם׃"));
hebsuperobject.biblemap.put("b5_32_18", new hebsuperobject(5,32,18,"צור ילדך תשי ותשכח אל מחללך׃"));
hebsuperobject.biblemap.put("b5_32_19", new hebsuperobject(5,32,19,"וירא יהוה וינאץ מכעס בניו ובנתיו׃"));
hebsuperobject.biblemap.put("b5_32_20", new hebsuperobject(5,32,20,"ויאמר אסתירה פני מהם אראה מה אחריתם כי דור תהפכת המה בנים לא אמן בם׃"));
hebsuperobject.biblemap.put("b5_32_21", new hebsuperobject(5,32,21,"הם קנאוני בלא אל כעסוני בהבליהם ואני אקניאם בלא עם בגוי נבל אכעיסם׃"));
hebsuperobject.biblemap.put("b5_32_22", new hebsuperobject(5,32,22,"כי אש קדחה באפי ותיקד עד שאול תחתית ותאכל ארץ ויבלה ותלהט מוסדי הרים׃"));
hebsuperobject.biblemap.put("b5_32_23", new hebsuperobject(5,32,23,"אספה עלימו רעות חצי אכלה בם׃"));
hebsuperobject.biblemap.put("b5_32_24", new hebsuperobject(5,32,24,"מזי רעב ולחמי רשף וקטב מרירי ושן בהמות אשלח בם עם חמת זחלי עפר׃"));
hebsuperobject.biblemap.put("b5_32_25", new hebsuperobject(5,32,25,"מחוץ תשכל חרב ומחדרים אימה גם בחור גם בתולה יונק עם איש שיבה׃"));
hebsuperobject.biblemap.put("b5_32_26", new hebsuperobject(5,32,26,"אמרתי אפאיהם אשביתה מאנוש זכרם׃"));
hebsuperobject.biblemap.put("b5_32_27", new hebsuperobject(5,32,27,"לולי כעס אויב אגור פן ינכרו צרימו פן יאמרו ידינו רמה ולא יהוה פעל כל זאת׃"));
hebsuperobject.biblemap.put("b5_32_28", new hebsuperobject(5,32,28,"כי גוי אבד עצות המה ואין בהם תבונה׃"));
hebsuperobject.biblemap.put("b5_32_29", new hebsuperobject(5,32,29,"לו חכמו ישכילו זאת יבינו לאחריתם׃"));
hebsuperobject.biblemap.put("b5_32_30", new hebsuperobject(5,32,30,"איכה ירדף אחד אלף ושנים יניסו רבבה אם לא כי צורם מכרם ויהוה הסגירם׃"));
hebsuperobject.biblemap.put("b5_32_31", new hebsuperobject(5,32,31,"כי לא כצורנו צורם ואיבינו פלילים׃"));
hebsuperobject.biblemap.put("b5_32_32", new hebsuperobject(5,32,32,"כי מגפן סדם גפנם ומשדמת עמרה ענבמו ענבי רוש אשכלת מררת למו׃"));
hebsuperobject.biblemap.put("b5_32_33", new hebsuperobject(5,32,33,"חמת תנינם יינם וראש פתנים אכזר׃"));
hebsuperobject.biblemap.put("b5_32_34", new hebsuperobject(5,32,34,"הלא הוא כמס עמדי חתם באוצרתי׃"));
hebsuperobject.biblemap.put("b5_32_35", new hebsuperobject(5,32,35,"לי נקם ושלם לעת תמוט רגלם כי קרוב יום אידם וחש עתדת למו׃"));
hebsuperobject.biblemap.put("b5_32_36", new hebsuperobject(5,32,36,"כי ידין יהוה עמו ועל עבדיו יתנחם כי יראה כי אזלת יד ואפס עצור ועזוב׃"));
hebsuperobject.biblemap.put("b5_32_37", new hebsuperobject(5,32,37,"ואמר אי אלהימו צור חסיו בו׃"));
hebsuperobject.biblemap.put("b5_32_38", new hebsuperobject(5,32,38,"אשר חלב זבחימו יאכלו ישתו יין נסיכם יקומו ויעזרכם יהי עליכם סתרה׃"));
hebsuperobject.biblemap.put("b5_32_39", new hebsuperobject(5,32,39,"ראו עתה כי אני אני הוא ואין אלהים עמדי אני אמית ואחיה מחצתי ואני ארפא ואין מידי מציל׃"));
hebsuperobject.biblemap.put("b5_32_40", new hebsuperobject(5,32,40,"כי אשא אל שמים ידי ואמרתי חי אנכי לעלם׃"));
hebsuperobject.biblemap.put("b5_32_41", new hebsuperobject(5,32,41,"אם שנותי ברק חרבי ותאחז במשפט ידי אשיב נקם לצרי ולמשנאי אשלם׃"));
hebsuperobject.biblemap.put("b5_32_42", new hebsuperobject(5,32,42,"אשכיר חצי מדם וחרבי תאכל בשר מדם חלל ושביה מראש פרעות אויב׃"));
hebsuperobject.biblemap.put("b5_32_43", new hebsuperobject(5,32,43,"הרנינו גוים עמו כי דם עבדיו יקום ונקם ישיב לצריו וכפר אדמתו עמו׃"));
hebsuperobject.biblemap.put("b5_32_44", new hebsuperobject(5,32,44,"ויבא משה וידבר את כל דברי השירה הזאת באזני העם הוא והושע בן נון׃"));
hebsuperobject.biblemap.put("b5_32_45", new hebsuperobject(5,32,45,"ויכל משה לדבר את כל הדברים האלה אל כל ישראל׃"));
hebsuperobject.biblemap.put("b5_32_46", new hebsuperobject(5,32,46,"ויאמר אלהם שימו לבבכם לכל הדברים אשר אנכי מעיד בכם היום אשר תצום את בניכם לשמר לעשות את כל דברי התורה הזאת׃"));
hebsuperobject.biblemap.put("b5_32_47", new hebsuperobject(5,32,47,"כי לא דבר רק הוא מכם כי הוא חייכם ובדבר הזה תאריכו ימים על האדמה אשר אתם עברים את הירדן שמה לרשתה׃"));
hebsuperobject.biblemap.put("b5_32_48", new hebsuperobject(5,32,48,"וידבר יהוה אל משה בעצם היום הזה לאמר׃"));
hebsuperobject.biblemap.put("b5_32_49", new hebsuperobject(5,32,49,"עלה אל הר העברים הזה הר נבו אשר בארץ מואב אשר על פני ירחו וראה את ארץ כנען אשר אני נתן לבני ישראל לאחזה׃"));
hebsuperobject.biblemap.put("b5_32_50", new hebsuperobject(5,32,50,"ומת בהר אשר אתה עלה שמה והאסף אל עמיך כאשר מת אהרן אחיך בהר ההר ויאסף אל עמיו׃"));
hebsuperobject.biblemap.put("b5_32_51", new hebsuperobject(5,32,51,"על אשר מעלתם בי בתוך בני ישראל במי מריבת קדש מדבר צן על אשר לא קדשתם אותי בתוך בני ישראל׃"));
hebsuperobject.biblemap.put("b5_32_52", new hebsuperobject(5,32,52,"כי מנגד תראה את הארץ ושמה לא תבוא אל הארץ אשר אני נתן לבני ישראל׃"));
hebsuperobject.biblemap.put("b5_33_1", new hebsuperobject(5,33,1,"וזאת הברכה אשר ברך משה איש האלהים את בני ישראל לפני מותו׃"));
hebsuperobject.biblemap.put("b5_33_2", new hebsuperobject(5,33,2,"ויאמר יהוה מסיני בא וזרח משעיר למו הופיע מהר פארן ואתה מרבבת קדש מימינו אש דת למו׃"));
hebsuperobject.biblemap.put("b5_33_3", new hebsuperobject(5,33,3,"אף חבב עמים כל קדשיו בידך והם תכו לרגלך ישא מדברתיך׃"));
hebsuperobject.biblemap.put("b5_33_4", new hebsuperobject(5,33,4,"תורה צוה לנו משה מורשה קהלת יעקב׃"));
hebsuperobject.biblemap.put("b5_33_5", new hebsuperobject(5,33,5,"ויהי בישרון מלך בהתאסף ראשי עם יחד שבטי ישראל׃"));
hebsuperobject.biblemap.put("b5_33_6", new hebsuperobject(5,33,6,"יחי ראובן ואל ימת ויהי מתיו מספר׃"));
hebsuperobject.biblemap.put("b5_33_7", new hebsuperobject(5,33,7,"וזאת ליהודה ויאמר שמע יהוה קול יהודה ואל עמו תביאנו ידיו רב לו ועזר מצריו תהיה׃"));
hebsuperobject.biblemap.put("b5_33_8", new hebsuperobject(5,33,8,"וללוי אמר תמיך ואוריך לאיש חסידך אשר נסיתו במסה תריבהו על מי מריבה׃"));
hebsuperobject.biblemap.put("b5_33_9", new hebsuperobject(5,33,9,"האמר לאביו ולאמו לא ראיתיו ואת אחיו לא הכיר ואת בנו לא ידע כי שמרו אמרתך ובריתך ינצרו׃"));
hebsuperobject.biblemap.put("b5_33_10", new hebsuperobject(5,33,10,"יורו משפטיך ליעקב ותורתך לישראל ישימו קטורה באפך וכליל על מזבחך׃"));
hebsuperobject.biblemap.put("b5_33_11", new hebsuperobject(5,33,11,"ברך יהוה חילו ופעל ידיו תרצה מחץ מתנים קמיו ומשנאיו מן יקומון׃"));
hebsuperobject.biblemap.put("b5_33_12", new hebsuperobject(5,33,12,"לבנימן אמר ידיד יהוה ישכן לבטח עליו חפף עליו כל היום ובין כתיפיו שכן׃"));
hebsuperobject.biblemap.put("b5_33_13", new hebsuperobject(5,33,13,"וליוסף אמר מברכת יהוה ארצו ממגד שמים מטל ומתהום רבצת תחת׃"));
hebsuperobject.biblemap.put("b5_33_14", new hebsuperobject(5,33,14,"וממגד תבואת שמש וממגד גרש ירחים׃"));
hebsuperobject.biblemap.put("b5_33_15", new hebsuperobject(5,33,15,"ומראש הררי קדם וממגד גבעות עולם׃"));
hebsuperobject.biblemap.put("b5_33_16", new hebsuperobject(5,33,16,"וממגד ארץ ומלאה ורצון שכני סנה תבואתה לראש יוסף ולקדקד נזיר אחיו׃"));
hebsuperobject.biblemap.put("b5_33_17", new hebsuperobject(5,33,17,"בכור שורו הדר לו וקרני ראם קרניו בהם עמים ינגח יחדו אפסי ארץ והם רבבות אפרים והם אלפי מנשה׃"));
hebsuperobject.biblemap.put("b5_33_18", new hebsuperobject(5,33,18,"ולזבולן אמר שמח זבולן בצאתך ויששכר באהליך׃"));
hebsuperobject.biblemap.put("b5_33_19", new hebsuperobject(5,33,19,"עמים הר יקראו שם יזבחו זבחי צדק כי שפע ימים יינקו ושפוני טמוני חול׃"));
hebsuperobject.biblemap.put("b5_33_20", new hebsuperobject(5,33,20,"ולגד אמר ברוך מרחיב גד כלביא שכן וטרף זרוע אף קדקד׃"));
hebsuperobject.biblemap.put("b5_33_21", new hebsuperobject(5,33,21,"וירא ראשית לו כי שם חלקת מחקק ספון ויתא ראשי עם צדקת יהוה עשה ומשפטיו עם ישראל׃"));
hebsuperobject.biblemap.put("b5_33_22", new hebsuperobject(5,33,22,"ולדן אמר דן גור אריה יזנק מן הבשן׃"));
hebsuperobject.biblemap.put("b5_33_23", new hebsuperobject(5,33,23,"ולנפתלי אמר נפתלי שבע רצון ומלא ברכת יהוה ים ודרום ירשה׃"));
hebsuperobject.biblemap.put("b5_33_24", new hebsuperobject(5,33,24,"ולאשר אמר ברוך מבנים אשר יהי רצוי אחיו וטבל בשמן רגלו׃"));
hebsuperobject.biblemap.put("b5_33_25", new hebsuperobject(5,33,25,"ברזל ונחשת מנעליך וכימיך דבאך׃"));
hebsuperobject.biblemap.put("b5_33_26", new hebsuperobject(5,33,26,"אין כאל ישרון רכב שמים בעזרך ובגאותו שחקים׃"));
hebsuperobject.biblemap.put("b5_33_27", new hebsuperobject(5,33,27,"מענה אלהי קדם ומתחת זרעת עולם ויגרש מפניך אויב ויאמר השמד׃"));
hebsuperobject.biblemap.put("b5_33_28", new hebsuperobject(5,33,28,"וישכן ישראל בטח בדד עין יעקב אל ארץ דגן ותירוש אף שמיו יערפו טל׃"));
hebsuperobject.biblemap.put("b5_33_29", new hebsuperobject(5,33,29,"אשריך ישראל מי כמוך עם נושע ביהוה מגן עזרך ואשר חרב גאותך ויכחשו איביך לך ואתה על במותימו תדרך׃"));
hebsuperobject.biblemap.put("b5_34_1", new hebsuperobject(5,34,1,"ויעל משה מערבת מואב אל הר נבו ראש הפסגה אשר על פני ירחו ויראהו יהוה את כל הארץ את הגלעד עד דן׃"));
hebsuperobject.biblemap.put("b5_34_2", new hebsuperobject(5,34,2,"ואת כל נפתלי ואת ארץ אפרים ומנשה ואת כל ארץ יהודה עד הים האחרון׃"));
hebsuperobject.biblemap.put("b5_34_3", new hebsuperobject(5,34,3,"ואת הנגב ואת הככר בקעת ירחו עיר התמרים עד צער׃"));
hebsuperobject.biblemap.put("b5_34_4", new hebsuperobject(5,34,4,"ויאמר יהוה אליו זאת הארץ אשר נשבעתי לאברהם ליצחק וליעקב לאמר לזרעך אתננה הראיתיך בעיניך ושמה לא תעבר׃"));
hebsuperobject.biblemap.put("b5_34_5", new hebsuperobject(5,34,5,"וימת שם משה עבד יהוה בארץ מואב על פי יהוה׃"));
hebsuperobject.biblemap.put("b5_34_6", new hebsuperobject(5,34,6,"ויקבר אתו בגי בארץ מואב מול בית פעור ולא ידע איש את קברתו עד היום הזה׃"));
hebsuperobject.biblemap.put("b5_34_7", new hebsuperobject(5,34,7,"ומשה בן מאה ועשרים שנה במתו לא כהתה עינו ולא נס לחה׃"));
hebsuperobject.biblemap.put("b5_34_8", new hebsuperobject(5,34,8,"ויבכו בני ישראל את משה בערבת מואב שלשים יום ויתמו ימי בכי אבל משה׃"));
hebsuperobject.biblemap.put("b5_34_9", new hebsuperobject(5,34,9,"ויהושע בן נון מלא רוח חכמה כי סמך משה את ידיו עליו וישמעו אליו בני ישראל ויעשו כאשר צוה יהוה את משה׃"));
hebsuperobject.biblemap.put("b5_34_10", new hebsuperobject(5,34,10,"ולא קם נביא עוד בישראל כמשה אשר ידעו יהוה פנים אל פנים׃"));
hebsuperobject.biblemap.put("b5_34_11", new hebsuperobject(5,34,11,"לכל האתות והמופתים אשר שלחו יהוה לעשות בארץ מצרים לפרעה ולכל עבדיו ולכל ארצו׃"));
hebsuperobject.biblemap.put("b5_34_12", new hebsuperobject(5,34,12,"ולכל היד החזקה ולכל המורא הגדול אשר עשה משה לעיני כל ישראל׃"));

